INSERT INTO `mdt_reports` (`id`, `char_id`, `title`, `incident`, `charges`, `author`, `name`, `date`, `jailtime`) VALUES
	(16, 137, 'Tyler Trumbone | Arrest #001', 'ARREST  Tyler Trumbone | Arrest #001\n----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------\n\nOfficers Involved: \n360 V.Hunter\n\n----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------\n\nItem\'s Taken: \nNothing\n----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------\n\nSituation Report: \nV.Hunter caught suspect attempting to steal car\n----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------\n\n-Additional info-\n\nAccomplices:\n\nVehicles Used:\n\nWitness statements:\n\nName\nStatement\nSignature of witness with date\n\n----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------\n\nPleaded: **GUILTY**\n\n----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------', '{"(F) Grand Theft":1}', 'Vinnie Hunter', 'Tyler Trumbone', '02-12-2021 15:28:11', 5),
	(17, 66, 'John Doe | Arrest #001', '.          Plead Not Guilty ', '{"(M) Petty Theft":1}', 'Robert Stone', 'John Doe', '02-12-2021 16:11:51', NULL),
	(18, 72, 'Arthur Morgan | Arrest #001', 'I responded to 2 seperate car alarm thefts in the Parking lot of the mega mall. Upon arrival i made visual contact with Mr Morgan in the seat of the alarm for the 4 door sultan and also a Mr John Doe in the seat of a 2 door futo. Mr Morgan tried telling me that he had just bought the futo. When i approached Mr John Doe He then gave me the exact opposite saying the he in fact had just bought the car. Myself a civilian ride along as well as another officer on scene witnessed them in the vehicles that had been called in for car jacking\'s. Neither one of there stories matched up at all. I was advised by high command to go ahead and charge both of them. Plead Not Guilty ', '{"(M) Petty Theft":1}', 'Robert Stone', 'Arthur Morgan', '02-12-2021 16:17:18', NULL),
	(21, 155, 'Jack Davis | Arrest #001', 'Officer(s) Involved: 232 R.Stone 628 J.Greyson\n\n----------------------\nNarrative: Officer Stone and I were at a traffic stop and Mr. Jack Davis pulled behind us and started hocking his horn nonstop. He than pulled away, ran a red light, scratched our vehicle, and almost ran me over. That than lead to a us pulling him over. He was questioned and his vehicle came back stolen and he failed to provide any evidence that was his car. He was than searched and he had a pistol on him with no gun license. He was than taken down to MRPD and he pleaded guilty to all the charges listed.\n\n----------------------\nEvidence:Pistol\n\n----------------------\nSuspect Pleaded Guilty', '{"(M) Criminal Possesion of a Firearm [Class 1]":1,"(I) Failure to Obey Traffic Control Devices":1,"(F) Grand Theft Auto":1}', 'Jax Greyson', 'Jack Davis', '02-12-2021 19:31:00', NULL),
	(22, 118, 'R.Kiriko Arrest #001', 'Officer(s) Involved:\n301 | Taylor Williams \n351 | Darren Cone\n550 | Ned Tucker\n222 | Richard Cranium\n----------------------\nNarrative:\nUnit 222 was in a 10-80 with a stolen 4 door vehicle, 301 and other units clocked into service and joined the 10-80. The suspect evaded dangerously endangering lives and eventually 10-50\'d in the side rail of the highway. The driver fled from his vehicle and the foot chase ended with 351 tasing the suspect and detaining him. \n----------------------\nEvidence:\nMugshot -https://cdn.discordapp.com/attachments/686534616433033218/810132562042552390/unknown.png \n----------------------\nSuspect Pleaded Guilty\n', '{"(M) Joyriding":1,"(F) Reckless Evading":1}', 'Taylor Williams', 'Richard Kiriko', '02-13-2021 05:11:30', 15),
	(23, 145, 'C. Lirent | Arrest #001', 'Mr Lirent pulled in front of me and turned right, when he was in the left lane, I also noticed that Mr Lirent had a smashed rear windows.\n\nI proceeded to pull him over and question me, he informed me his vehicle was a rental and showed me his rental papers.', '{"(I) Non-Road Worthy Vehicle":1,"(I) Negligent Driving":1}', 'Dirty Dixie', 'Clarence Lirent', '02-13-2021 14:22:53', NULL),
	(24, 66, 'J.Doe Arrest #2', 'Officers Involved:\n222 R. Cranium\n--------------------------------------------------------\nWitnesses:\nN/A\n--------------------------------------------------------\nIndividuals Involved:\nJ. Doe\n-------------------------------------------------------\nItems Confiscated:\n1x pistol (Returned)\n1x advanced screwdriver (confiscated)\n--------------------------------------------------------\nIncident Report:\n222 R. Cranium rolled up on the scene of active shots from a car when i seen a red ellie chasing a grey four door sultan. I chased the ellie to pull him over at that time he fled the scene. I called in the 80 at which time we chased him from sanora road to legion square at that time his car disabled he started to flee on foot after multiple times of him being asked to stop he was tased on scene at that time he was arrested and brought to PD for booking.\n--------------------------------------------------------\nAdditional Notes:\nJ. Doe **pled guilty** to his charge.\n--------------------------------------------------------', '{"(M) Evading":1}', 'Richard Cranium', 'John Doe', '02-13-2021 17:26:56', 10),
	(25, 210, 'E.Kipalog - Arrest #001', 'Officer(s) Involved:\n121 M.King\n101 A.Noire\n120 D.Gilmore\n\n\n----------------------\nNarrative:\nSuspect Kidnapped 101 A.Noire and proceeded to keep a hold of him after multiple commands to release. He failed to release and was tazed twice. At which point he got up and hit 121 M.King.\n\nAfter transport to medic to see to injuries he was transported down to MRPD for processing. While there he was read his charges and sent to bollingbroke for a 5 months stint.\n\n\n----------------------\nEvidence:\nNone on him\n\n----------------------\nSuspect Pleaded Guilty - Wants to press charges against 101 for being homophobic.', '{"(M) Assault":1,"(F) Kidnapping":1}', 'Mike King', 'Eliot Kipalog', '02-13-2021 17:45:18', 5),
	(27, 65, 'Marty Woo Arrest 001', '*Officers Involved*\n305\n302\n301', '{"(M) Evading":1,"(M) Third Degree Robbery":1}', 'Michael Sarz', 'Marty Woo', '02-13-2021 20:26:43', 25),
	(28, 157, 'Arrest #1 G. Demon ', 'Officer(s) Involved:\n221 N. Jones\n305 M. Sarz\n121 M. King \n331 S. Rush\n----------------------\nNarrative:\nSuspect was in the front of the bank with the hostage. 221, 121,331 were in the 10-80. It went on for about 30 minutes, the suspects then drive straight into the water which 221 and 121 followed. 221 then lost eyes of the suspect that mad is ashore. \n----------------------\nEvidence:\nN/A\n----------------------\nSuspect Pleaded Guilty / Not Guilty:\nSuspect Pleaded Guilt', '{"(M) Evading":1,"(F) Accessory to First Degree Robbery":1}', 'Nate Jones', 'Gucci Demon', '02-13-2021 21:24:56', 15),
	(29, 145, 'C.Lirent Arrest #001', 'Officer(s) Involved: 202 A.Smith 236 T.Summers 301 T.Williams 550 Ned Tucker\n\n----------------------\nNarrative:\n236 and I werent on Scene but we ended up entering the chase about half way. We chased Mr. Lirent in a 9F for about 5 minutes until he pull back to one of his friends that was also in the robbery. He picked him up while he was about to be caught by other officers and we continued chasing him. The chase went on for another 10 minutes until Lirent hard 10-50d. they jumped out of the vehicle and began running. 236 and i stayed on Lirent while the other 2 officers chased the other suspect. We ended up detaining Lirent and bringing him back to MRPD for processing and booking. \n\n----------------------\nEvidence:\nNothing was found on Lirent\n----------------------\nSuspect Pleaded Guilty / Not Guilty\nGuilty.', '{"(M) Reckless Driving":1,"(F) Second Degree Robbery":1}', 'Aydin Smith', 'Clarence Lirent', '02-13-2021 22:39:27', 10),
	(30, 66, 'John Doe - (003)', '331 | S. Rush \n301 | T. Williams\n--------------------------\n\nAfter a long chase around the city 331 was left to bring John doe 331 takes John to a very short ride to Pillbox too get his prongs out. 331 Than takes John to and MRPD. I than fingerprint John Doe he also had a pistol. I take him to a cell and he asked 331 to touch 331 arm 331 lets him. John Doe grabs 331 and flips 331 and cuffs 331 and takes 331\'s  Keys and PD Pistol kidnaps 331 asking for someone on radio to pick john  doe up and takes and leaves 331 to Fudge Ln. \n\n-------------------------\nEvidence \nhttps://i.imgur.com/0gNTrS4.png [John Doe\'s pockets].\nhttps://i.imgur.com/l70tNXL.png [John Does 311]\n\n----------------------------------------------\n***Guilty or not Guilty***\n', '{"(M) Criminal Possesion of a Firearm [Class 1]":1,"(F) Criminal Possession of a Government-Issued Firearm":1,"(F) Kidnapping":1}', 'Scooter Rush', 'John Doe', '02-14-2021 00:28:51', 50),
	(31, 127, 'A. Coronza Arrest Report #001', 'Officer(s) Involved:\n302 E. Foo\n101 A. Noire\n221 N. Jones\n222 R. Cranium\n236 T. Summers\n----------------------\nIncident Report:\nWe responded to a grocery store robbery at the location on Davis Ave and Grove St where the suspects where at the scene in a black four door sedan. They had one hostage and demanded no spikes and a free passage for his safe return. We complied and got the hostage where a 10-80 ensued until we got to La Puerta Fwy Bridge where all 4 suspects jumped and my suspect Alejandro splatted on the concrete. We then transported them to PillBox for medical attention and down to MRPD where they where booked and proccessed. \n---------------------\nIndividuals Involved:\nMarty Woo\nTriston Skonberg\nJohn Doe(Warrant Served)\n---------------------\nItems Confiscated:\n(x1) Handcuffs\n----------------------\nAdditional Notes:\n***Suspect Pleaded Guilty***', '{"(M) Accessory to Third Degree Robbery":1}', 'Edgar Foo', 'Alejandro Coronza', '02-14-2021 01:00:30', 15),
	(32, 65, 'Marty Woo Arrest 002', 'Officer(s) Involved:\n221 N. Jones\n222 R. Cranium\n302 E. Foo\n101 A. Noire\n236 T. Summers\n----------------------\nNarrative:\nSummary: Officer N.Jones and I arrived at the grove street gas station where our suspect was with three others and they had a hostage. They attempted to rob the gas station but one of the criminals was dumb and forgot their lockpick so it proceeded to turn in to a chase where it ended after they jumped off a really fucking high bridge and shortly gave up after the suspects were taken to pillbox for medical then MRPD for processing.\n----------------------\nEvidence:\nN/A\n----------------------\nSuspect Pleaded Guilty / Not Guilty\nSuspect Pleaded Guilty', '{"(M) Evading":1,"(M) Accessory to Third Degree Robbery":1}', 'Nate Jones', 'Marty Woo', '02-14-2021 01:03:20', 10),
	(33, 67, 'Triston Skonberg Arrest 001', '                        !Plead Guilty!\n\nOfficers Involved:\n236 T.Summers\n221 N.Jones\n302 E.Foo\n222 R.Cranium\n101 A.Noire\n\nEvidence:\nhttps://gyazo.com/d1bd557afd107c9bfb15cb10e16e9ad3\n\nSummary: Officer N.Jones and I arrived at the grove street gas station where our suspect was with three others and they had a hostage. They attempted to rob the gas station but one of the criminals was dumb and forgot their lockpick so it proceeded to turn in to a chase where it ended after they jumped off a really fucking high bridge and shortly gave up after the suspects were taken to pillbox for medical then MRPD for processing.\n\n:Sentence and Fine:\nWas sentenced to 15 months and a $250 fine.\n\n\n\n\n', '{"(M) Evading":1,"(F) Accessory to Second Degree Robbery":1}', 'Tank Summers', 'Triston Skonberg', '02-14-2021 01:06:33', 15),
	(34, 182, 'Kenneth Brisendine (Arrest Report #001)', '\n Description Of the Event: Police responded to reports of a Vehicle Hijacking. On scene, police saw 2 males hop into a grey sultan. The vehicle then fled and lead into a 10-80 for about 10 minutes. The vehicle was damaged after the chase and so all four of the men had to bail out of the vehicle "Kenneth Brisendine" then started to open fire at 231. 231 returned fire and neutralised Brisendine. Kenneth Brisendine was then quick cloted for his GSW wounds and brought to "PillBox Hill Medical Center" for treatment.\n \nEvidence: x1 Pistol\n\nFine: 8000$ \nOfficers Involved: 231,222,350,361\n \nEvidence: x1 Pistol\n\nFine: 8000$ ', '{"(F) Attempted Murder on a Government Official":1,"(M) Evading":1}', 'Jamal Woodly', 'Kenneth Brisendine', '02-14-2021 03:56:30', 32),
	(35, 66, 'John Doe | Arrest #004', 'ARREST  John Doe | Arrest #004\n----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------\n\nOfficers Involved: \n360 | V.Hunter\n350 | J.Woodly\n231 | B.Harper\n201 | J.Gambino\n----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------\n\nItem\'s Taken: \n1 x MK2 Pistol\n1 x Adv Lockpick\n2 x Pistol boxes\n1 x Traphouse code\n----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------\n\nSituation Report: \nStore robbery at grove street gas station, drove around city recklessly, went up around highway, car started smoking then eventually headed to airport where shoot out happened downing 2 officers and all 3 suspects. Took to pillbox for medical, read rights, charges and pled GUILTY\n----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------\n\n-Additional info-\n\nAccomplices:\n\nVehicles Used:\n\nWitness statements:\n\nName\nStatement\nSignature of witness with date\n\n----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------\n\nPleaded: **GUILTY**\n\n----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------', '{"(M) possesion of Burglary Tools":1,"(F) Battery with a Deadly Weapon":1,"(F) Second Degree Robbery":1,"(F) Criminal Possession of a Government-Issued Firearm":1}', 'Vinnie Hunter', 'John Doe', '02-14-2021 05:08:32', 30),
	(36, 70, 'C. Tucker Arrest 001', '*Officers Involved*\n305 | Sarz\n210 | Papani\n121 | King\n\n-------\n305 and 210 Went down to forum for reports of a house robbery.  We waited outside the appartment too see if someone was going to come out and a Male did.  He at first was very \n-------\n\n*Plead Guilty*\n\n------\nAdv Lockpick', '{"(I) First Degree Speeding":1}', 'Frank Reeves', 'Jase Turner', '02-14-2021 05:56:27', NULL),
	(37, 68, 'Speeding', 'Speeding during poor weather conditions', '{"(I) First Degree Speeding":1}', 'Frank Reeves', 'Joe Kov', '02-14-2021 09:42:03', NULL),
	(38, 109, 'B.Hanna - Written Warning #001', 'Was 1st offence ,if found comitting the same crime will be arrested and charged for the offences', '{"(M) possesion of Burglary Tools":1}', 'Frank Reeves', 'Beshoy Hanna', '02-14-2021 10:34:35', NULL),
	(39, 196, 'Alex Hunter #001', 'Officer(s) Involved: 323 R.Stone 202 Aaron 361 F.Reeves 120 D.Gilmore \n\n----------------------\nNarrative: We recieved an alarm at the general store just before paleto bay, We got on camera\'s and seen Mr Hunter leaving the scene in a Black Gang burrito with a Lost M.C paintjob. We then initiated a 10-38 code 5. Upon a search of Mr hunter and his vehicle with his permisson we found the advanced lockpick. He was then read his rights and brought to MRPD for processing where he plead guilty. \n\n----------------------\nEvidence: Camera evidence of him fleeing the scene and 1x advanced lockpick.\n\n----------------------\nSuspect Pleaded Guilty ', '{"(M) possesion of Burglary Tools":1,"(M) Robbery":1}', 'Robert Stone', 'Alex Hunter', '02-14-2021 11:48:14', 10),
	(40, 78, 'J. Daniels | Ticket #001', 'I clocked Mr Daniels going 75mph through a red light, in a 55mph zone, so I pulled him over and questioned him, he was rather rude and unplesant.\n\nGiven that, I informed him what he did, that I clocked him speeding, and fined him for his traffic offenses.', '{"(I) Failure to Stop":1}', 'Dirty Dixie', 'John Daniels', '02-14-2021 12:01:19', NULL),
	(41, 212, 'Bill Mcnasty Arrest #001', 'Officer(s) Involved: 323 R.Stone 202 Aaron 120 Gillmore \n\n----------------------\nNarrative:We recieved a  stolen car call up near paleto bay. Upon arrival an officer found 2 suspects stealing a small truck with a LMG mounted machine gun. After a small chase into paleto bay they were aiming the gun at officers and attempting to flee. We then opened fire and was able to take him and 2 other suspect\'s into custody. \n\n----------------------\nEvidence:\n\n----------------------\nSuspect Pleaded Guilty ', '{"(M) Evading":1,"(F) Criminal Possesion of a Firearm [Class 2]":1}', 'Robert Stone', 'Bill McNasty', '02-14-2021 12:33:48', 10),
	(43, 212, 'Bill McNasty Tunnel Shooting', 'Officer(s) Involved:\n101 - A. Noire\n302 - E. Foo\n222 - R. Cranium\n234 - P. Nutt\n------------------------\nItems Confiscated:\n1x Pistol\n------------------------\nEvidence:\nhttps://cdn.discordapp.com/attachments/809743203656925184/810664706783445022/unknown.png\nhttps://cdn.discordapp.com/attachments/809743203656925184/810664740393058314/unknown.png\n------------------------\nNarrative:\nOfficers chased three suspects into the tunnels where they were shot by officer when they opened fired. Suspects were taken to Pillbox for treatment.\n------------------------\nNote(s):\nSuspect pleaded guilty.', '{"(M) Joyriding":1,"(F) Criminal Possesion of a Firearm [Class 2]":1}', 'Phillip Nutt', 'Bill McNasty', '02-14-2021 16:21:47', 15),
	(44, 232, 'John Fuego - Arrest - 001', 'Officer(s) Involved:\n101 - A. Noire\n302 - E. Foo\n222 - R. Cranium\n234 - P. Nutt\n------------------------\nItems Confiscated:\n1x Pistol\n------------------------\nEvidence:\nhttps://cdn.discordapp.com/attachments/809743203656925184/810664706783445022/unknown.png\nhttps://cdn.discordapp.com/attachments/809743203656925184/810664740393058314/unknown.png\n------------------------\nNarrative:\nOfficers chased three suspects into the tunnels where they were shot by officer when they opened fired. Suspects were taken to Pillbox for treatment.\n------------------------\nNote(s):\nSuspect pleaded guilty.', '{"(M) Evading":1,"(M) Criminal Possesion of a Firearm [Class 1]":1,"(M) Assault on Emergency Personnel":1}', 'Ajax Noire', 'John Fuego', '02-14-2021 16:25:47', 15),
	(46, 263, 'C. T Arrest#1', 'Officers Involved:\n222 R. Cranium\n101 A. Noire\n202 A. Smith\n--------------------------------------------------------\nWitnesses:\nN/A\n--------------------------------------------------------\nIndividuals Involved:\nCrazy T\nDanny G\n\n-------------------------------------------------------\nItems Confiscated:\n1x Glock\n1x Advanced Lockpick\n4x Boss Chains\n1x Certificate\n1x Galaxy S10\n--------------------------------------------------------\nIncident Report:\n222 responded to a house robbery where we raided the house the individuals were in, they were hiding in the closet in the house Crazy was in the closet unknown to us when we held Danny at gunpoint Crazy came out held me at gunpoint at the time Danny shot and i open fired on Crazy putting him down, i arrested Crazy at that time got him medical attention and took him back to PD for booking.\n--------------------------------------------------------\nAdditional Notes:\n**pled guilty to both charges**\n--------------------------------------------------------', '{"(M) Third Degree Robbery":1,"(M) possesion of Burglary Tools":1}', 'Richard Cranium', 'Crazy T', '02-14-2021 17:50:54', 30),
	(47, 117, 'JJ Rush Warrant 02/14/2021', 'Officers Involved:\n302 | E. Foo\n234 | P. Nutt\n236 | T. Summers\n202 | A. Smith\n--------------------------------------------------------\nIndividuals Involved:\nJJ Rush\n--------------------------------------------------------\nItems Confiscated:\nN/A\n--------------------------------------------------------\nEvidence:\nWitnesses\n--------------------------------------------------------\nNarrative:\nA 10-13 came in from 234 where we were able to identify JJ rush had stabbed him Nutt. JJ showed up and told me " I found this knife" To which I attempted to detain him. He kept resisting and I chased him and he pulled the knife out without me seeing and stabbed me right in the gut. I then went down and 236 and 202 where able to disable him. After everyone getting medical treatment, I was taking him down to proccessing and he broke from the cuffs and kicked my scrotom casuing me to collapse and jumped over the PD gate and dissappeared. \n--------------------------------------------------------\nAdditional Notes:\nScooter Rush\'s brother\n--------------------------------------------------------', '{"(F) Attempted Murder on Emergency Personnel":2}', 'Edgar Foo', 'JJ Rush', '02-14-2021 18:12:40', 90),
	(48, 70, 'Jase Turner - Arrest - 002', 'Officer(s) Involved:\n101 - A. Noire\n302 - E. Foo\n331 - S. Rush\n236 - T. Summers\n221 - N. Jones\n222 - R. Cranium\n---------------------\nItems Confiscated:\n1x Pistol\n1x Electronic Kit\n2x Adv Lockpicks\n47x Gold Bars\n---------------------\nEvidence:\n[Pockets] https://cdn.discordapp.com/attachments/809743203656925184/810720977519640626/unknown.png\n[Pockets] https://cdn.discordapp.com/attachments/809743203656925184/810721018607566888/unknown.png\n---------------------\nNarrative:\nOfficers responded to a bank robbery where suspects left then lead officers on a chase to which ended in red garage where then they shot at officers. Two suspects were taken into custody.\n---------------------\nNote(s):\nSuspect pleaded guilty.\nWeapon License revoked.', '{"(F) Possesion of Stolen Goods":1,"(F) Attempted Murder on Emergency Personnel":1,"(F) First Degree Robbery":1,"(M) possesion of Burglary Tools":1,"(M) Criminal Possesion of a Firearm [Class 1]":1}', 'Ajax Noire', 'Jase Turner', '02-14-2021 19:59:53', 40),
	(49, 87, 'Dustin KowalChuck #001', '331 | S. Rush\n302 | E. Foo\n236 | T. Summers\n222 | R. Cranium\n221 | N. Jones\n101 | A. Noire\n--------------------------------------------------------\nIndividuals Involved:\nJase Turner\n--------------------------------------------------------\nItems Confiscated:\nPistol\n--------------------------------------------------------\nEvidence:\nhttps://i.imgur.com/zCOFbhL.png(pistol)\n--------------------------------------------------------\nNarrative:\n5 OFFICERS OTHER THAN 101 CAME ON SCENE THEY ASK FOR THE LOS SANTOS SPECIAL. WE WENT WITH THERE DEMANDS WE APPLIED THOSE DEMANDS WE GOT INTO A CHASE THEY CRASH THERE CAR IN FRONT OF RED GARAGE 3 SUSPECTS RUN 1 RUN TOWARDS THE DEL PERRO FREEWAY 10-13S WERE BEING CALLED 331 HEAD BACK TO RED GARAGE GETS DUE TO 71S TO HELP DUSTIN 221 GET GETS SHOT DOWN AND DOES A SUMMERSAUGHT DOWN RED GARAGE 302 AND 331 PUSH TO THE OP OF RED GARAGE AND 302 GOES DOWN 331 FINISHES DUSTIN OFF WE GIVE HIM MEDICAL AND 331 TAKES DUSTIN TO BE PROSSED\n--------------------------------------------------------\nAdditional Notes:\n***PLEAD GUILTY***\n--------------------------------------------------------\n\n', '{"(M) Criminal Possesion of a Firearm [Class 1]":1,"(F) First Degree Robbery":1}', 'Scooter Rush', 'Dustin Kowalchuk', '02-14-2021 20:15:30', 15),
	(50, 65, 'Marty Woo Warrant', 'Officers Involved: \n236 T.Summers\n221 N.Jones\n101 A.Noire\n331 S.Rush\n222 R.Cranium\n302 E.Foo\n\nSummary:\nWe arrived at a gas station robbery where there were two individuals and they had a hostage they later fled and drove to LS international airport where they had two individuals setup on a roof they then proceeded to gun all six of the officers on duty down at the end marty woo took off his mask and spit on me', '{"(F) Attempted Murder on Emergency Personnel":3}', 'Tank Summers', 'Marty Woo', '02-14-2021 21:04:42', 135),
	(51, 66, 'Arrest #2 T. Skonberg', 'Officer(s) Involved: 201 J. Gambino, 231 B. Harper, 236 T. Summers, 221 N. Jones, 210 H. Papani, 202 A. Smith, \n\n----------------------\nNarrative:\n\nThe Suspect picked up john doe and began another 10-80. The chase lasted about 30-50 minutes. We then had them blocked in and marty woo was shot and taken to pill box We then got into another foot chase, the officers then took the two suspects to MRPD for proccesing. \n----------------------\nEvidence:\nhttps://cdn.discordapp.com/attachments/769817153775730699/810770189934788678/8ca20204e90748ee31bc01726c178527.png\n----------------------\nSuspect Pleaded Guilty / Not Guilty\nSuspect Pleaded Guilty', '{"(M) Evading":1,"(M) Receiving / Possesion of Stolen Property":1}', 'James Gambino', 'John Doe', '02-14-2021 23:04:51', 5),
	(52, 67, 'Arrest #2 T. Skonberg', 'Officer(s) Involved: 201 J. Gambino, 231 B. Harper, 236 T. Summers, 221 N. Jones, 210 H. Papani, 202 A. Smith, \n\n----------------------\nNarrative:\n\nThe Suspect picked up john doe and began another 10-80. The chase lasted about 30-50 minutes. We then had them blocked in and marty woo was shot and taken to pill box We then got into another foot chase, the officers then took the two suspects to MRPD for proccesing. \n----------------------\nEvidence:\nhttps://cdn.discordapp.com/attachments/769817153775730699/810770189934788678/8ca20204e90748ee31bc01726c178527.png\n----------------------\nSuspect Pleaded Guilty / Not Guilty\nSuspect Pleaded Guilty', '{"(M) Reckless Driving":1}', 'Nate Jones', 'Triston Skonberg', '02-14-2021 23:11:59', 5),
	(53, 66, 'J. Doe Arrest #005', '*** PLEAD GUILTY ***\n\nOfficers Involved:\n\n201 | Chief James Gambino\n202 | Asst. Chief Aydin Smith\n210 | Lieutenant Ryder Papani\n222 | Sergeant Richie Cranium\n231 | Senior Officer Beyla Harper\n\n-----------------------------------------\n\nIndividuals Involved:\n\nJohn Doe\nAlejandro Coronza\n\n-----------------------------------------\n\nItems Confiscated:\n\n1x Handcuffs\n\n------------------------------------------\n\nNarrative:\n\n\n------------------------------------------\n\nAdditional Notes:\n\nNONE', '{"(F) Reckless Evading":1,"(F) Tampering of Evidence":1,"(F) Second Degree Robbery":1}', 'Hunter Papani', 'John Doe', '02-14-2021 23:57:24', 25),
	(54, 127, 'A. Coronza Arrest #2', 'Officers Involved:\n201 J. Gambino\n222 R. Cranium\n231 B. Harper\n--------------------------------------------------------\nIndividuals Involved:\nJ. Doe\n\n-------------------------------------------------------\nItems Confiscated:\nN/A\n--------------------------------------------------------\nIncident Report:\nMr Coronza was robbing the fleeca on Legion square when we responed to the scene. after a few minutes of chasing coronza he hopped out of the moving vehicle and started to flee on foot, after a few yards he gave up and hopped into my cruiser i then took him back to PD and booked him.\n--------------------------------------------------------\nAdditional Notes:\n**pled guilty**\n--------------------------------------------------------', '{"(F) Kidnapping":1,"(F) Second Degree Robbery":1}', 'Richard Cranium', 'Alejandro Coronza', '02-15-2021 00:01:42', 25),
	(55, 109, 'Beshoy Hanna #Arrest 001 ', 'Officer(s) Involved: 232 R.Stone 360 V.Hunter 628 J.Greyson 688 S.FoxGlove 120 D.Gilmore \n\n----------------------\nNarrative: Mr beshoy was wanted for questioning regarding some funds that he had come into possession of. He was spotted by a Confidental Informant near the are of PDM. Upon arrival i told him he was being detained for this and taken to MRPD for questioning. I asked him if he consent to a search to which he agreed and i found the items listed below. Upon being questioned at P.D  He come clean on robberies he had done in the past, He was able to give me a number on how many houses and banks he had robbed. I then offered him to get a lawyer He said he would plead guilty for to these charges for a reduced sentence. This was on conducted under the supervision of 120 Trooper D.Gilmore. The suspect then plead guilty and was sentenced to 30 months. \n\n----------------------\nEvidence: 5x joints 1x lockpick 1x Pistol \n\n----------------------\nSuspect Pleaded Guilty', '{"(M) Breaking and Entering":8,"(M) Possesion of Marijuana":1,"(M) Criminal Possesion of a Firearm [Class 1]":1,"(F) First Degree Robbery":5,"(F) Kidnapping":5,"(F) Reckless Evading":1}', 'Robert Stone', 'Beshoy Hanna', '02-15-2021 06:46:31', 30),
	(56, 283, 'Fat Pete Arrest 001', '*Officers Involved*\n305 - Sarz \n331 - Rush\n-------\nRush and myself arrived on scene by mega mall where a citizen was stabbed by the name of Jace Turner.  We got a report that 3 individuals stabbed him one of them being "Fat" and wearing orange.  Upon our arrival back at MRPD 3 males were there one being a male who was obese as oprah and wearing Oragne.  Upon my search of him he had a knife on him.  Jace Identified him as ONE of the Assailants but did not say it was him alone.  But Mr. Fat Pete Pleaded Guilty\n-------\n\n*Pleaded Guilty\n\n-------\n\nItems Confiscated \n*Knife*', '{"(M) Assault":1}', 'Michael Sarz', 'fat pete', '02-15-2021 13:48:22', 5),
	(57, 182, 'K. Brisendine Arrest 002', '*Officers Involved*\n305 - Sarz\n120 - Gilmore\n352 - McGuinness\n210 - Papani\n221 - Jones\n121 - King\n\n------- \nReport: Units arrived to a bank truck at humane labs.  Upon units arrival we determined it was fudge boys and they were held up in side.  Our team did a excellent job communicating a not getting overzealous.  We clapped this fudge packers back into there willy wonka wrapper and sent there asses down to booty town.  No officers downed by any Fudge boys, but king was used as a meat shield to down these boys.\n\n-------\n*Items Confiscated*\nPistol\nBody Armor x2\n\n-------\n\n*Pleaded Guilty for Reduction*', '{"(M) Robbery":1,"(M) Criminal use of a Firearm":1}', 'Michael Sarz', 'Kenneth Brisendine', '02-15-2021 15:11:33', 30),
	(58, 66, 'J. Doe Arrest #006', '*** PLEAD GUILTY ***\n\n\nOfficers Involved\n\n120 | Trooper Doofy Gilmore\n121 | Trooper Mike King\n210 | Lieutenant Hunter Papani\n221 | Sergeant Nate Jones\n305 | Captain Michael Sarz\n352 | Deputy Spencer McGuinness\n\n-----------------------------------------------------\n\nIndividuals Involved:\n\nMarty Woo\nTriston Skonberg\n\n-----------------------------------------------------\n\nItems Confiscated:\n\n- 1x Glock 47\n- 1x Handcuffs\n- 9x Pistol Ammo\n- 6x Stacks of Cash\n- 6x Rolls of Cash\n- $18,377 Cash\n\n------------------------------------------------------\n\nReport:\n\nUnits arrived to a bank truck at humane labs.  Upon units arrival we determined it was fudge boys and they were held up in side.  Our team did a excellent job communicating a not getting overzealous.  We clapped this fudge packers back into there willy wonka wrapper and sent there asses down to booty town.  No officers downed by any Fudge boys, but king was used as a meat shield to down these boys.', '{"(M) Possession of an Illegal Item":1,"(F) Battery with a Deadly Weapon":1,"(F) Second Degree Robbery":1,"(M) Criminal Possesion of a Firearm [Class 1]":1}', 'Hunter Papani', 'John Doe', '02-15-2021 15:16:03', 40),
	(59, 67, 'T. Skonberg Arrest #003', '*** PLEAD GUILTY ***\n\n\nOfficers Involved\n\n120 | Trooper Doofy Gilmore\n121 | Trooper Mike King\n210 | Lieutenant Hunter Papani\n221 | Sergeant Nate Jones\n305 | Captain Michael Sarz\n352 | Deputy Spencer McGuinness\n\n-----------------------------------------------------\n\nIndividuals Involved:\n\nMarty Woo\nTriston Skonberg\nJohn Doe\n\n-----------------------------------------------------\n\nItems Confiscated:\n\n- 1x Glock 47\n- 4x Pistol Ammo\n\n------------------------------------------------------\n\nReport:\n\nUnits arrived to a bank truck at humane labs.  Upon units arrival we determined it was fudge boys and they were held up in side.  Our team did a excellent job communicating a not getting overzealous.  We clapped this fudge packers back into there willy wonka wrapper and sent there asses down to booty town.  No officers downed by any Fudge boys, but king was used as a meat shield to down these boys.', '{"(F) Second Degree Robbery":1,"(F) Battery with a Deadly Weapon":1,"(M) Criminal Possesion of a Firearm [Class 1]":1}', 'Hunter Papani', 'Triston Skonberg', '02-15-2021 15:23:02', 30),
	(60, 65, 'Marty Woo Arrest #3', 'Officer(s) Involved: 121 M. King | 210 H. Papani | 305 M. Sarz | 221 N. Jones | 352 S. McGuinness |\n\n----------------------\nNarrative: Myself and 221 were in our explorer, and responded to the humane labs bank truck robbery. We arrived on scene second, after 121. Once arrived, we took cover and waited for additionals. They all arrived, and we slowly made our way into humane labs. We returned fire at the suspects, and once we downed the suspects, myself and 221 brought 121 and Mr. Woo to Pillbox. We then brought Mr Woo to MRPD for processing.\n\n----------------------\nEvidence: Glock, Ammo\n\n----------------------\nSuspect(s) Plead Guilty', '{"(F) Attempted Murder on Emergency Personnel":1,"(F) Bribery":1,"(M) Evading":1,"(M) Criminal Possesion of a Firearm [Class 1]":1}', 'Spencer McGuinness', 'Marty Woo', '02-15-2021 15:29:21', 50),
	(61, 180, 'Jim Flowers | Arrest #001', 'Arrest  Jim Flowers | Arrest #001\n----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------\n\nOfficers Involved: \n360 | V.Hunter\n----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------\n\nItem\'s Taken: \n1 x Pistol\n2 x Pistol ammo\n1 x Lockpick\n1 x Phone\n1 x Radio\n----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------\n\nSituation Report: \n360 Responded to Robbery in Paleto\n----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------\n\n-Additional info-\n\nAccomplices:\n\nVehicles Used:\n\nWitness statements:\n\nName\nStatement\nSignature of witness with date\n\n----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------\n\nPleaded: **NOT GUILTY**\n\n----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------\n', '{"(F) First Degree Robbery":1}', 'Vinnie Hunter', 'Jim Flowers', '02-15-2021 16:14:35', 25),
	(62, 141, 'Christopher Johnson | ARREST #001', 'ARREST  Christopher Johnson | Arrest #001\n----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------\n\nOfficers Involved: \n360 | V.Hunter\n101 | A.Noire\n121 | M.King\n354 | J.Chainy\n355 | E.Deverour\n230 | B.Bert\n----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------\n\nItem\'s Taken: \n1 x Pistol\n2 x Phone\n1 x Radio\n1 x Handcuffs\n3 x Box\'s Ammo\n----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------\n\nSituation Report: \nScene started off as a chase with 121 and 101 A.Noire, because 101 was speaking to him and they didn\'t like his tone. They continued to follow and try to talk to us, we stopped at the lights they spoke to us and then tried to run from us. \n\nThey crashed into a PD Taurus initiating a chase, we then chased them for around 40 minutes, they eventually lost all tails apart from 1 officer. They crashed and foot bailed which ended up in a shoot out. 3 of the 4 suspects went down while 1 got away.\n\nWe got EMS to scene to stabalize the suspects and downed officer, we then transported them to MRPD for processing.\n\n----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------\n\n-Additional info-\n\nAccomplices:\n\nVehicles Used:\n\nWitness statements:\n\nName\nStatement\nSignature of witness with date\n\n----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------\n\nPleaded: **GUILTY**\n\n----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------', '{"(F) Attempted Murder on Emergency Personnel":1,"(M) Evading":1,"(M) Criminal Possesion of a Firearm [Class 1]":1}', 'Vinnie Hunter', 'Christopher Johnson', '02-15-2021 16:55:47', 35),
	(63, 87, 'D.Kowalchuk - Arrest #002', 'Officers Involved:\n101 A.Noire\n121 M.King\n230 B.Bert\n354 D.Chainey\n355 E.Devereaux\n360 V.Hunter\n\n\n--------------------------------------------------------\nIndividuals Involved:\nD.Kowalchuk\nC.Johnson\nT.Trumbone\n\n--------------------------------------------------------\nItems Confiscated:\n1x Glock\n\n--------------------------------------------------------\nEvidence:\n1x Glock\n\n--------------------------------------------------------\nNarrative:\n\nScene started off as a chase against myself and 101 A.Noire, because 101 was speaking to him and they didn\'t like his tone. They continued to follow and try to talk to us, we stopped at the lights they spoke to us and then tried to run from us. \n\nThey crashed into a PD Taurus initiating a chase, we then chased them for around 40 minutes, they eventually lost all tails apart from 1 officer. They crashed and foot bailed which ended up in a shoot out. 3 of the 4 suspects went down while 1 got away.\n\nWe got EMS to scene to stabalize the suspects and downed officer, we then transported them to MRPD for processing.\n\n--------------------------------------------------------\nAdditional Notes:\nSuspected pleaded guilty\n\n\n--------------------------------------------------------\n\n\n', '{"(M) Assault on Emergency Personnel":1,"(M) Evading":1,"(M) Criminal Possesion of a Firearm [Class 1]":1}', 'Mike King', 'Dustin Kowalchuk', '02-15-2021 17:14:21', 15),
	(64, 137, 'Tyler Trumbone', 'Tyler Trumbone || Arrest #002\n-----------------------------\n\nOfficers Involved: \n\n-360 V.Hunter\n-121 M. King\n-101 A.Noire \n-230 B.Bert--------\n-354 D.Chainey-----------------------------------------------355 E.Deverux--------------------------------------------------------------------\n\nItem\'s Taken: \n\n-Class 1- Pistol---------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------\n\nSituation Report: \n\n-Chased a vechiel x2 for about 15 mikes then their car breaks down then a 3rd 95 got into the chase. Then head up into vinewood then proceed to have a shootout. -----------------------------------------------------------\n', '{"(F) Attempted Murder on Emergency Personnel":1,"(M) Evading":1,"(M) Criminal Possesion of a Firearm [Class 1]":1}', 'Dick Chainey', 'Tyler Trumbone', '02-15-2021 17:32:57', 35),
	(65, 281, 'A.Johnson - Arrest #001', 'Officers Involved:\n121 M.King\n332 T.McGee\n\n--------------------------------------------------------\nIndividuals Involved:\nA.Johnson\n\n--------------------------------------------------------\nItems Confiscated:\n1x Knife \n1x Adv. Lock Pick\n2x Rolex\n3x Gold Chain\n3x Diamond Ring\n\n--------------------------------------------------------\nEvidence:\nCaught inside the property\n\n--------------------------------------------------------\nNarrative:\n\nResponded to a call down in Mirror Park for a House Robbery, upon arrival had a 2 door muscle car out the property with the engine still running, Called through the door multiple times for them to surrender and leave the property with their hands up.\n\nCommands failed so breached the property with 332, caught the suspect in the hallway actively robbing, command him to stop and put his hands up to which he complied. Arrested and then transported to MRPD for processing.\n\n--------------------------------------------------------\nAdditional Notes:\nSuspect pleaded guilty to charges\n\n--------------------------------------------------------\n', '{"(M) Breaking and Entering":1,"(M) possesion of Burglary Tools":1,"(M) Receiving / Possesion of Stolen Property":1}', 'Mike King', 'Andy Johnson', '02-15-2021 17:51:19', 15),
	(67, 158, 'N. Tarantino Arrest#001', '*** Plead Guilty ***\n\nOfficers involved:\n360 V. Hunter\n332 C. McGree\n210 Papani\n222 Richie\n\nItems confiscated:\nx1 pistol\nx1 adv lockpick\nx1 walk stick (to be returned)\nx2 oxy 100mg\n\nIndividuals involved:\nAnna Sarah\nN. Tarantino\n\nIncident report:\nOfficers responded to shots fired at the front of pillbox. Upon arrival 332 found a white comet on the set of stairs at pillbox with a downed individual in the bush next to it. Upon questioning a downed officer (360) after a shootout his statement corresponded that our downed individual we found in the bushes was the shooter against our downed officer. Tarantino dropped an oxy bottle on the floor at pillbox to turn into pillbox. 360 approached to question him about the oxy but he wasn\'t compliant. After a small scuffle 360 pulled out his non lethal to try and detain the civilian. Tarantino reacted with taking out his pistol and shooting 360. Another individual took off with the downed Tarantino ', '{"(F) Attempted Murder on Emergency Personnel":1,"(M) possesion of Burglary Tools":1}', 'Cameron McGree', 'Nola Tarantino', '02-15-2021 18:50:49', 20),
	(68, 295, 'Rae Duh | Arrest #001', 'Officers Involved:\n\n233 | D. Dixie\n101 | A. Noira\n\n--------------------------------------------------------\nIndividuals Involved:\n\nRae Duh\n\n--------------------------------------------------------\nEvidence:\n\nBody Cam\nWitness\n\n--------------------------------------------------------\nNarrative:\n\nMyself & 101 noticed that Mr Duh was being very suspicious and had previously attempted a GTA and ended up in a fist fight, so we kept our distance and watched him.\n\nAfter a little while, when we were out of his sight, he stopped jaywalking, and attempted to steal a red sports car, I parked in from of him code 2 as he was trying to hotwire it, and pulled a non lethal on him, backup arrived (101) and he surrendered and was placed in cuffs.', '{"(F) Grand Theft Auto":1}', 'Dirty Dixie', 'Rae Duh', '02-15-2021 19:03:23', 6),
	(69, 65, 'Marty Woo Ticket #001', 'Mr woo was N.bound on strawberry avenue when he blew a red light in front of me. He was compliant and issued a ticket for this traffic violation. ', '{"(I) Failure to Obey Traffic Control Devices":1}', 'Robert Stone', 'Marty Woo', '02-15-2021 20:48:50', NULL),
	(70, 66, 'John Doe Warrant #001', 'Mr doe was on the scene of a shots fired call where he had shot down an individual and was actively robbing him. He was tazed and taken into custody where i was processing him. During processing he was able to hit me 1 time with his fist and instantly put me to the ground. He then robbed me of the items i had confiscated from him as well as my PD issue pistol. He then used me as a bargaining tool to escape custody and use me as a hostage to escape. Before he was taken into custody he tried to evade on foot resulting in him being tazed. He had been finger printed by myself during this arrest Coming back to 1x John Doe.', '{"(F) Criminal Possession of a Government-Issued Firearm":1,"(F) Escaping Custody":1,"(M) Criminal Possesion of a Firearm [Class 1]":2,"(M) Assault on Emergency Personnel":1,"(M) Criminal Threats":1,"(M) Evading":1,"(F) Kidnapping":1,"(F) First Degree Robbery":2,"(F) Attempted Murder":1}', 'Robert Stone', 'John Doe', '02-15-2021 21:15:52', NULL),
	(71, 281, 'Andy Johnson arrest 002', 'Officer(s) Involved:\n\nR. Stone 232, S. Foxglove 688\n\nNarrative:\n\nWe were called to a car jacking in the Mirror Park area, Saw another man leaving the area, Which we then noticed Mr. Johnson attempting to break in to a house. He was complient and gave himself up. \n\nEvidence:\n\n1x Advanced Lockpick\n\nSuspect Pleaded Guilty', '{"(M) Breaking and Entering":1,"(M) possesion of Burglary Tools":1}', 'Skarletta Foxglove', 'Andy Johnson', '02-15-2021 21:55:25', NULL),
	(72, 281, 'Andy Johnson arrest #03', 'Officer(s) Involved:\n\nR. Stone 232, S. Foxglove 688\n\nNarrative:\n\n\nNoticed A grey car traveling at high speeds going southbound near ammunation after trying to pull him over it turned into a 10-80 which we lost him on the north on the freeway. We were then able to relocate him at Elgin and Occupation and with heat stayed on him. Final top was near Paleto in which case there was a foot bail. After he was detained he gave up and was arrested.\n----------------------\nEvidence:\n\n----------------------\nSuspect Pleaded Guilty', '{"(F) Grand Theft Auto":1,"(F) Reckless Evading":1}', 'Skarletta Foxglove', 'Andy Johnson', '02-15-2021 22:50:57', NULL),
	(73, 174, 'Johnson Chaderick Ticket #001', 'We spotted Mr caderick going S.bound on elgin avenue where he went through a red light and made a illegal u-turn at the apartment building.', '{"(I) Failure to Obey Traffic Control Devices":1,"(I) Illegal U-Turn":1}', 'Robert Stone', 'johnson Chaderick', '02-16-2021 00:32:22', NULL),
	(74, 65, 'M.Woo - Arrest #004', 'Officers Involved:\n121 M.King\n210 R.Papani\n120 D.Gilmore\n354 D.Chainey\n\n--------------------------------------------------------\nIndividuals Involved:\nMarty Woo\n\n--------------------------------------------------------\nItems Confiscated:\n1x Pistol \n1x Radio\n\n--------------------------------------------------------\nEvidence:\nCheck Evidence Channel\n\n\n--------------------------------------------------------\nNarrative:\n\nResponded to a 10-13A of D.Chainey, upon arriving on scene I saw a vehicle leaving a high rates of speed. I attempted to pull the vehicle over but they proceeded to run.\n\nI chased them until they crashed just of of elysian fields, he then tried to open fire on the two officers that tried to pull him over, he got gunned down.\n\nWe treated him for his injuries and then transported him to Pillbox Medical to cleared by EMS, Once cleared we transported him down to MRPD for processing.\n\n--------------------------------------------------------\nAdditional Notes:\nMarty Woo Pleaded Guilty to his Charges.\n\n--------------------------------------------------------', '{"(F) Grand Theft Auto":1,"(M) Assault on Emergency Personnel":1,"(M) Criminal use of a Firearm":1,"(F) Attempted Murder on Emergency Personnel":1,"(M) Criminal Possesion of a Firearm [Class 1]":1}', 'Mike King', 'Marty Woo', '02-16-2021 15:07:31', 50),
	(75, 196, 'A. Hunter | Arrest #002', 'Officers Involved:\n\n233 | D. Dixie\n120 | D. Gilmore\n\n--------------------------------------------------------\nIndividuals Involved:\n\nAlex Hunter\n\n--------------------------------------------------------\nItems Confiscated:\n\nx1 Glock 47\nx1 Knife\nx1 Advanced Lockpick Set\nx2 Lockpick Set\n\n--------------------------------------------------------\nEvidence:\n\nWe arrived on the scene and he was hiding with his firearm aimed at the door.\n\n--------------------------------------------------------\nNarrative:\n\nMyself and 120 responded to a burglary alarm, we searched around the building and then proceeded to enter the property.\n\nWhen we entered we announced ourselves and informed all individuals to surrender.\n\nWe proceeded further into the property and Mr Hunter was hiding in the bathroom, crouched down with his gun pointed at the door, he surrendered and came peacefully.', '{"(M) Third Degree Robbery":1,"(M) possesion of Burglary Tools":1}', 'Dirty Dixie', 'Alex Hunter', '02-16-2021 15:19:51', 30),
	(76, 141, 'C. Johnson Arrest 001', '*Officers Involved*\n305 | Sarz\n331 | Rush\n120 | Gilmore\n\n------\nOfficers Responded to a shooting on Strawberry.  Sarz pushed out a team full of officers using two insurgents given the shots fired were coming from a NINEF that has been in multiple shootings during the day.  We stopped C. Johnson down by the trash company and took his bitch ass into custody.\n\n------\n\n*Items Confiscated*\nFake ID\nGlock\n\n-------\n\n\n*Pleaded Guilty*', '{"(F) Reckless Evading":1,"(M) Criminal Possesion of a Firearm [Class 1]":1}', 'Michael Sarz', 'Christopher Johnson', '02-16-2021 15:34:49', 30),
	(77, 304, 'J. Kov Arrest #001', '*** PLEAD GUILTY ***\n\nOfficers Involved:\n\n101 | Colonel Ajax Noire\n121 | Trooper Mike King\n210 | Lieutenant Ryder Papani\n302 | Undersheriff Edgar Foo\n331 | Senior Deputy Scooter Rush\n\n------------------------------\n\nIndividuals Involved:\n\nJoe Kov\nUNKNOWN\nUNKNOWN\n\n------------------------------\n\nItems Confiscated:\n\n1x Glock 47\n1x Advanced Lockpick\n2x Pistol Ammo\n$1,000 Cash\n\n-------------------------------\n\nIncident Report:\n\n\n\n-------------------------------\n\nAdditional Notes:\n\nNONE\n', '{"(F) Second Degree Robbery":1,"(M) Criminal Possesion of a Firearm [Class 1]":1,"(F) Kidnapping":1}', 'Hunter Papani', 'Joe Kov', '02-16-2021 17:31:12', 25),
