	(81, 141, 'Christopher Johnson Arrest #2', 'Officers Involved:\n\n351 Darren Cone\n301 Taylor Williams\n305 Michael Sarz\n101 Ajax Noire\n231 Beyla Harper\n331 Scooter Rush\n\nItems Confiscated:\n\nPistol MII\n\nEvidence:\n\nWeapon serial number: 64Dfi4jL488HxXw\nPhoto Coming\n\nNarrative:\n\nCall came in for the Bank truck and Air 1 spotted 4 individuals.\nMyself and Taylor were in Air 1 as 4 officers where on scene with 231 being downed they were shooting off the roof at air 1 as well as shooting at other officers. Two were downed but 3 of them escaped. Perp was downed and left on the roof.\n\n\nPleaded guilty', '{"(F) Attempted Murder on Emergency Personnel":1,"(F) Second Degree Robbery":1,"(F) Criminal Possession of a Government-Issued Firearm":1}', 'Darren Cone', 'Christopher Johnson', '02-16-2021 21:22:41', 60),
	(82, 65, 'M. Woo Arrest 006', '*Officers Invovled*\n305 | Sarz\n201 | Gambino\nCornslop\n210 | Papani\n\n-------\nMarty Woo and his BFF John Doe robbed a Fleeca Bank near Legion Square.  We this these individuals were following myself around quite a bit potentially trying to kidnap me.  I don\'t know why, I think they have a major crush on me or something.  Either way we chased both individuals using the ASU and a ground unit.  Eventually they went FULL SEND near the Boiling Broke and started to run on foot. Air one continued comms as units got closer to the scene.  1 individual who was later ID as Marty Woo hid in the bushes in an attempted to Stab and Officer as they attempted to Arrest Doe.  Woo was placed in cuffs shortly after being filled with lead and turned into Swiss cheese.  Woo made some empty ass threats to myself as well, fuck that guy.\n-------\n*Pleaded Guilty*\n-------\nItems Confiscated\nKnife', '{"(M) Robbery":1,"(M) Evading":1,"(M) Battery on Emergency Personnel":1}', 'Michael Sarz', 'Marty Woo', '02-17-2021 15:07:52', 20),
	(83, 66, 'J.Doe arrest #007', 'Officers Involved: 201 J. Gambino, 252 J. Cornslop , 210 H. Papani, 305 M. Sarz, 121 King\n\n--------------------------------------------------------\nIndividuals Involved: Marty Woo\n\n--------------------------------------------------------\nItems Confiscated: N/A\n\n--------------------------------------------------------\nEvidence: N/A\n\n--------------------------------------------------------\nNarrative: John Doe and Marty Woo were found robbing a Fleeca bank at Vespucci blvd. 10-80 Ensued and turned into a foot persuit, both suspects apprehended outside of the prison. John Doe was brought to MRPD for processing and pleaded guilty\n\n--------------------------------------------------------\nAdditional Notes: Pleaded guilty\n\n--------------------------------------------------------', '{"(M) Evading":1,"(F) Second Degree Robbery":1}', 'Joeham Cornslop', 'John Doe', '02-17-2021 15:13:23', 15),
