	(88, 285, 'Zack Costello', '                  !Plead Guilty!\nOfficers Involved:\n236 T.Summers\n221 N.Jones\n331 S.Rush\n211 T.Katana\n\nEvidence:\nhttps://gyazo.com/0a1ccf1fd03ffeb2151c6699c09dd59b\n\nSummary: I arrived to the scene of a fleeca bank robbery and saw two individuals inside they also had a hostage They asked for officer N.Jones to get a haircut and free passage shortly after it proceeded into a chase where it eventually ended after the two time and ninja crashed their red two door sports car next to paleto where they were shortly caught and taken to MRPD for processing\n\nAdditional notes: Fined $3500', '{"(M) Criminal Possesion of a Firearm [Class 1]":1,"(M) Evading":1,"(F) Second Degree Robbery":1}', 'Tank Summers', 'Zack Costello', '02-17-2021 21:12:11', 25),
	(89, 170, 'Arrest #1 T. TheFuck', 'Officers Involved:\n221 N.Jones\n236 T. Summers\n331 S. Rush \n211 T. Katana\n--------------------------------------------------------\nIndividuals Involved:\n2 time Champ DrDisrespect\nNinja \n--------------------------------------------------------\nItems Confiscated:\nx1 Knife\n92 Gold bars\nx1 USB\nx1 Electronic Kit\n--------------------------------------------------------\nEvidence: I arrived to the scene of a fleeca bank robbery and saw two individuals inside they also had a hostage They asked for officer N.Jones to get a haircut and free passage shortly after it proceeded into a chase where it eventually ended after the two time and ninja crashed their red two door sports car next to paleto where they were shortly caught and taken to MRPD for processing\n\n\n--------------------------------------------------------\nAdditional Notes:\nSuspect Pled Guilty \n\n--------------------------------------------------------', '{"(M) Reckless Driving":1,"(F) Possesion of Stolen Goods":1,"(F) Second Degree Robbery":1}', 'Nate Jones', 'Tobias TheFuck', '02-17-2021 21:15:28', 25),
	(90, 108, 'J. Demon Arrest 001', '*Officers Involved*\n305 | Sarz\n331 | Rush\n355 | Devereaux\n\n-------\nDeputies arrived to a Fleeca robbery on Legion by 3 individuals, a pretty good and long chase went on after we got the hostage out.  The 3 split on foot and 3 deputies chased all 3 suspects.  1 Suspect got broken out of pillbox as an officer was being treated for GSWs.\n-------\n*Items Confiscated*\nGlock\nGold 37\nSecurity Card\nOxy3\n-------\n*Pleaded Guilty*\n', '{"(M) Evading":1,"(M) Robbery":1}', 'Michael Sarz', 'Jose Demon', '02-17-2021 23:00:38', 25),
	(91, 110, '02/18/2021 -Arrest 1- Krystal Lights', '== Officers Involved ==\n305 | Sarz\n331 | Rush\n355 | Devereaux\n\n\n-------------------\nOfficers had arrived on scene to a Fleeca Bank robbery in Legion square. Inside of the bank there were 3 individuals and one hostage. After a long chase the suspects sultan eventually had enough and wouldn\'t go no more. The group of three had ran off in different directions. I myself chased Krystal for a solid 10 minutes on foot until she was finally taken into custody. \n\n-------------------\nItems Confiscated:\n-Pistol \n-66x Gold Bar\n-4x pistol ammo\n-Trojan usb \n-Electronic Stick\n\n\n------------------\n\n=== Plead Guilty ===', '{"(M) Robbery":1,"(M) Evading":1}', 'Earl Devereaux', 'Krystal Lights', '02-17-2021 23:08:21', 20),
	(92, 66, 'John Doe | ARREST #008', 'Title format  Adam Brian | Arrest #008\n----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------\n\nOfficers Involved: \n360 | V.Hunter\n202 | \n----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------\n\nItem\'s Taken: \n$6972 cash\n----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------\n\nSituation Report: \nRobbed store\n----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------\n\n-Additional info-\n\nAccomplices: N/A\n\nVehicles Used:Orange 4x4\n\nWitness statements: N/A\n\nName\nStatement\nSignature of witness with date\n\n----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------\n\nPleaded: **GUILTY**\n\n----------------------------------------------------------------------------------------------------------------------------------------------------------------------------------------\n', '{"(F) Kidnapping":1,"(F) First Degree Robbery":1,"(M) Assault":1}', 'Vinnie Hunter', 'John Doe', '02-18-2021 13:17:08', 80),
	(93, 343, 'C. King Arrest #001', 'Officers Involved:\n302 | E. Foo\n121 | M. King\n551 | D. Mercer\n--------------------------------------------------------\nIndividuals Involved:\nJohn doe\'s car was on scene\n--------------------------------------------------------\nItems Confiscated:\nIn evidence\n--------------------------------------------------------\nEvidence:\nN/A\n--------------------------------------------------------\nNarrative:\nResponded to a vangelicos where this individual was already downed, he was helping but was batoned to the kneee so was disabled, hence why only charged with accessory.\n-----------------------------------------\nAdditional Notes:\n***Plead Guilty***\n\n--------------------------------------------------------\n', '{"(M) Accessory to Third Degree Robbery":1}', 'Edgar Foo', 'Colton King', '02-18-2021 15:48:01', 10),
	(94, 78, 'John Daniels Arrest #1', 'Officers Involved:\n\n351 Darren Cone\n301 Taylor Williams\n550 Ned Tucker\n101 Ajax Noire\n551 Droxx Mercer\n\nIndividuals Involved:\n\nKai Jackson\nRichard Kiriko\n\nItems Confiscated:\n\n1x glock\n1x concealed carry license\nEvidence:\n\nNarrative:\n\n4 Officers were in a 10-80 after the 10-32B that lasted about 10 minutes, I was at MRPD when i got called for the 10-13 of 550 and 101.I hopped out of the vehicle at the scene to have one of the felons open fire  at 301, We both opened fire back and 301 was 10-13. EMS collected the downed officers, 551 along with EMS took them to Pillbox hospital. I collected John Daniels and the other officers went back for the last two felons. John Daniels was tasered and cuffed before he had the chance to use his firearm. License confiscated along with weapon.\n', '{"(F) Second Degree Robbery":1}', 'Darren Cone', 'John Daniels', '02-18-2021 23:01:03', 20),
	(95, 118, 'Richard Kiriko - Arrest - 002', 'Officer(s) Involved:\n101 - A. Noire\n301 - T. Williams\n351 - D. Cone\n550 - N. Tucker\n551 - D. Mercer\n--------------------\nItem(s) Confiscated:\n1x Pistol\n1x Knife\n--------------------\nNarrative:\nOfficers responded to a jewelry store robbery to which they then chased the suspects, to which they then crashed in Vespucci and started shooting. \n\nThree officers were downed and two suspects were downed.\n\nR. Kiriko pleaded guilty.\n--------------------\nNote(s):\nNone', '{"(M) Evading":1,"(F) Second Degree Robbery":1,"(F) Kidnapping":1,"(F) Attempted Murder on Emergency Personnel":3,"(M) Criminal Possesion of a Firearm [Class 1]":1}', 'Ajax Noire', 'Richard Kiriko', '02-18-2021 23:12:21', 100),
	(96, 176, 'Kai Jackson Arrest #001', '550 || Tucker\nOfficer(s) Involved:\n101 | Ajax Noire\n301 | Taylor Williams\n351 | Darren Cone\n550 | Ned Tucker\n551 | Droxx Mercer\n----------------------\nNarrative:\nGlock 47 x1\nLockpick x1\nRolex x100\n----------------------\nEvidence:\n4 Officers were in a 10-80 after the 10-32B that lasted about 10 minutes, Kai Jackson had a 1v1 shootout with 301 and was downed. a second suspect fired at officers, We both opened fire back and 301 was downed. EMS collected the downed officers, 551 along with EMS took them to Pillbox hospital. Kai only shot 301 hence why he was given the 1 attempted murder charge. License confiscated along with weapon.\n----------------------\nSuspect Pleaded Guilty', '{"(M) Criminal use of a Firearm":1,"(M) Evading":1,"(F) Second Degree Robbery":1,"(F) Attempted Murder on Emergency Personnel":1,"(F) Kidnapping":1}', 'Ned Tucker', 'Kai Jackson', '02-18-2021 23:34:39', 80),
	(97, 355, 'I. Richards Arrest #01', 'Officers Involved:\n205 T. Katana\n210 H. Papani\n211 N. Jones\n--------------------------------------------------------\nIndividuals Involved:\nIsaiha Richards\n--------------------------------------------------------\nItems Confiscated:\nx1 Lockpick\nx1 Advanced Lockpick\n--------------------------------------------------------\nEvidence:\nhttps://prnt.sc/101eoez\nhttps://prnt.sc/101eqds\n--------------------------------------------------------\nReport:\nRichards was seen by 205 and 210 stealing a local punder. The officers then pulled up and asked him to exit the vehicle. Following Richards decided to drive off beginning the 10-80. After a few minutes of recklessly evading the suspect attempted to push 205\'s car into the wall resulting in the wreckage of his vehicle. A short foot chase then followed to which ended with a taser deployment and the suspect was aprehended.\n\n--------------------------------------------------------\nAdditional Notes:\nSuspect plead guilty\n--------------------------------------------------------', '{"(F) Grand Theft Auto":1,"(F) Reckless Evading":1}', 'Takeshi Katana', 'Isaiha Richards', '02-19-2021 16:45:08', 15),
	(99, 277, 'C. Tucker Arrest 001', '*Officers Involved*\n305 | Sarz\n210 | Papani\n121 | King\n\n-------\n\n-------\n\n*Plead Guilty*\n\n------\nAdv Lockpick', '{"(M) possesion of Burglary Tools":1,"(M) Evading":1}', 'Michael Sarz', 'Chris Tucker', '02-19-2021 18:11:15', 25),
	(100, 141, '02/19/2021 -Arrest- Christopher Johnson', 'Officers Involved:\n355 Earl Devereaux\n---------------\nItems Confiscated:\nx1 Glock \nx1 Adv Lockpick\nx4 samsung phones\n---------------\nNarrative: Officers were given a call from dispatch stating that there was an individual seen breaking and entering into peoples homes. I myself responded to the call and breached the house that was being robbed. When inside I stumbled upon a guy searching through a chest. I then told the individual to put his hands up to which he was detained\n', '{"(M) Robbery":1,"(M) Criminal Possesion of a Firearm [Class 1]":1,"(M) possesion of Burglary Tools":1}', 'Earl Devereaux', 'Christopher Johnson', '02-19-2021 21:03:08', 40),
	(101, 343, 'Colton King | Arrest | #2', 'Officers Involved:\n358 Tim Bobbins\n355 Earl\n359 Paul Blart\n--------------------------------------------------------\nIndividuals Involved:\nColton King\n--------------------------------------------------------\nItems Confiscated:\n1x Mk2 Pistol\n1x Flashlight\n--------------------------------------------------------\nEvidence:\n\n--------------------------------------------------------\nNarrative:\n359 was stabbed by the individual, when we insued in a 80 we lost them. Then we later found the individual got into an 80 and then succesfully apprehended the individual.\n--------------------------------------------------------\nAdditional Notes:\nSuspect Plead Guilty\n--------------------------------------------------------', '{"(M) Joyriding":1,"(F) Carjacking":1,"(F) Attempted Murder on Emergency Personnel":1,"(F) Grand Theft Auto":1}', 'Tim Bobbins', 'Colton King', '02-19-2021 21:08:46', 10),
	(102, 176, 'Kai Jackson - Arrest - 002', 'Officer(s) Involved:\n101 - A. Noire\n301 - T. Williams\n358 - T. Bobbins\n302 - E. Foo\n331 - S. Rush\n--------------------------------------------------------------------------------------------\nItem(s) Confiscated:\n1x Glock\n------------------------------------------------------------------------------------------------------\nNarrative:\nOfficers responded to a bank truck to which 4 officers went down then, and 4 criminals, to which the only officer up 358 took everyone to Pillbox Med. Suspects pleaded guilty.\n---------------------\nNote(s):\n- None', '{"(M) Criminal Possesion of a Firearm [Class 1]":1,"(F) Attempted Murder":1,"(F) Accessory to Second Degree Robbery":1}', 'Scooter Rush', 'Kai Jackson', '02-20-2021 00:56:32', 30),
	(103, 190, 'Frost White | Arrest | #1', 'Officers Involved:\n358 Tim Bobbins \n302 Edgar Foo\n331 Scooter Rush\n352 Mcguiness\n101 Ajax Noire\n--------------------------------------------------------\nIndividuals Involved:\nFrost White\n--------------------------------------------------------\nItems Confiscated:\n1x Glock\n13x Oxy\n--------------------------------------------------------\nEvidence:\nhttps://imgur.com/a/ZkoTcjK\n--------------------------------------------------------\nNarrative:\n358 signed on duty when fellow officer said that there was a bank truck. This is when 358 responded and shot at the individuals shooting at the officers. After 10 minutes of back and forth shooting the PD came out on top and went to arrest the individuals. One of the four was picked up and taken away by someone else. \n--------------------------------------------------------\nAdditional Notes:\nSuspect Plead Guilty\n--------------------------------------------------------', '{"(M) Possesion of a Controlled Dangerous Substance":1,"(F) Attempted Murder on Emergency Personnel":1,"(F) Second Degree Robbery":1}', 'Tim Bobbins', 'Frost White', '02-20-2021 01:01:24', 60),
	(104, 118, 'Richard Kiriko - Arrest - 003', 'Officer(s) Involved:\n101 - A. Noire\n301 - T. Williams\n358 - T. Bobbins\n302 - E. Foo\n331 - S. Rush\n---------------------\nItem(s) Confiscated:\n1x Glock\n10x IFAK\'s\n3x Oxy\n---------------------\nNarrative:\nOfficers responded to a bank truck to which 4 officers went down then, and 4 criminals, to which the only officer up 358 took everyone to Pillbox Med. Suspects pleaded guilty.\n---------------------\nNote(s):\n- None', '{"Criminal Possession of Government Property (x1)":1,"(F) Second Degree Robbery":1,"(M) Criminal Possesion of a Firearm [Class 1]":1,"(F) Attempted Murder on Emergency Personnel":1,"(M) Possesion of a Controlled Dangerous Substance":1}', 'Ajax Noire', 'Richard Kiriko', '02-20-2021 01:18:57', 100),
	(105, 65, 'M. Woo Arrest #007', 'Officer(s) Involved: 232 R.Stone 120 D.Gilmore 121 M.King 210 Papani \n\n----------------------\nNarrative: We were trying to fullfill a warrant on John Doe who is a known Fudge boy gang member, Marty  Woo also a fudge boy was in a large box truck where he slammed it into our cruiser\'s causing one officer to face injuries resulting in a 10-13. Mr Woo was then stopped in a code 5 and brought down to MRPD where he plead guilty to these charges. \n\n----------------------\nEvidence:\nTruck used https://prnt.sc/102bieo\n----------------------\nSuspect Pleaded Guilty ', '{"(F) Attempted Murder on Emergency Personnel":1,"(M) Vandalism of Government Property":1}', 'Robert Stone', 'Marty Woo', '02-20-2021 15:40:56', 20),
	(106, 277, 'C. Tucker Arrest#002', 'Officers Involved:\n121\n353\n\n--------------------------------------------------------\nIndividuals Involved:\nChris Tucker\n--------------------------------------------------------\nItems Confiscated:\nPistol x-1\n--------------------------------------------------------\nEvidence:\n\n--------------------------------------------------------\nNarrative:\nReceived a 911 for shots fired from vehicle 121 showed up to scene and saw a local shot in their vehicle. We drove around looking for the suspected vehicle we found around legion garage and pulled suspect over. He consented to a GSR test which came back positive. Weapon was confiscated. \n--------------------------------------------------------\nAdditional Notes:\nPlead guilty\n--------------------------------------------------------', '{"(M) Criminal use of a Firearm":1}', 'Roy Mustang', 'Chris Tucker', '02-20-2021 19:14:58', 15),
	(107, 343, 'Colton King arrest #3', 'Officers Involved:\nTim Bobbins | 358\nPaul Blart\n------------- \nConfiscated: Individual had no illegal items\n--------------------------------------------------------\nNarrative: The suspect was pulled over for rear ending myself and paul blart. Once we had gotten out of the vehicle mr king decided to take off in his rust bucket. Keep in mind this chase did not last long and he was very shortly taken into custody right after.', '{"(M) Reckless Driving":1}', 'Earl Devereaux', 'Colton King', '02-20-2021 19:52:10', 5),
	(108, 141, 'C. Johnson Arrest #004', 'MDT Example\nOfficers Involved:\n236 | T. Noire\n211 | N. Jones\n331 | S. Rush\n251 | D. Jacobs\n636 | J. Slider\n302 | E. Foo\n--------------------------------------------------------\nIndividuals Involved:\nJohn Fuego\nDustin C.\nTyler\n--------------------------------------------------------\nItems Confiscated:\n(1x) Glock\n(8x) Oxy\n--------------------------------------------------------\nEvidence:\nEvidence Channel\n--------------------------------------------------------\nSummary: We got a call for a Bank trunk being hit in little seoul when we arrived we had the bank truck parked in an alley with two purple cars behind it there were 4 suspects up on a roof that is when E.foo pulled out air one and we dropped on top of a higher roof where they proceeded to drive off in the purple cars shortly after we had a shootout on vespucci beach where all suspects were injured and after were taken to pillbox for medical.\n--------------------------------------------------------\nAdditional Notes:\n*** PLEAD GUILTY ***\n--------------------------------------------------------', '{"(M) Criminal use of a Firearm":1,"(M) Criminal Possesion of a Firearm [Class 1]":1,"(F) Second Degree Robbery":1}', 'Edgar Foo', 'Christopher Johnson', '02-20-2021 21:06:40', 35),
	(109, 232, 'John Fuego Arrest #002', 'Officers Involved:\n236 | T. Noire\n211 | N. Jones\n331 | S. Rush\n251 | D. Jacobs\n636 | J. Slider\n302 | E. Foo\n--------------------------------------------------------\nIndividuals Involved:\nJohn Fuego\nDustin C.\nTyler\n--------------------------------------------------------\nItems Confiscated:\n(1x) Glock\n(3x) Oxy\n(4x) Money Roll\n(5x) Money Bands\n--------------------------------------------------------\nEvidence:\nEvidence Channel\n--------------------------------------------------------\nNarrative:\nA bank truck robbery insued at Little Seoul, where 4 individuals on the roof tops of the buildings surrounding the truck. After a short shootout the individuals loaded up into a purple Sultan RS and a purple Jester Classic. A shootout then ensued on the beach where the individuals went down and where brought into police custody \n--------------------------------------------------------\nAdditional Notes:\n*** PLEAD GUILTY ***\n--------------------------------------------------------', '{"(F) Attempted Murder":2,"(M) Criminal Possesion of a Firearm [Class 1]":1,"(F) Second Degree Robbery":1}', 'Danny Jacobs', 'John Fuego', '02-20-2021 21:11:40', 60),
	(110, 137, 'Tyler Trumbone arrest 002', '                    !Plead Guilty!\n\nOfficers Involved:\n236 T.Noire\n211 N.Jones\n331 S.Rush\n636 J.Sider\n302 E.Foo\n251 D.Jacobs\n------------------------------------------------------------\nEvidence:\nhttps://gyazo.com/249f505d3759d45c17d1b8538ec7a9b8\nhttps://gyazo.com/9c8734752885cb80340bda38f2cb1e6b\n\n------------------------------------------------------------\nSummary: We got a call for a Bank trunk being hit in little seoul when we arrived we had the bank truck parked in an alley with two purple cars behind it there were 4 suspects up on a roof that is when E.foo pulled out air one and we dropped on top of a higher roof where they proceeded to drive off in the purple cars shortly after we had a shootout on vespucci beach where all suspects were injured and after were taken to pillbox for medical.\n\n------------------------------------------------------------\nAdditional Notes:\nFined $3000\n', '{"(M) Criminal use of a Firearm":1,"(M) Criminal Possesion of a Firearm [Class 1]":1,"(F) Second Degree Robbery":1}', 'Tank Noire', 'Tyler Trumbone', '02-20-2021 21:42:04', 45),
	(111, 66, 'Tobias TheFuck | Arrest | #4', 'Officers Involved:\n333 Tim Bobbins\n640 Appel Bottom\n120 Doofy Gilmore\n\n--------------------------------------------------------\nIndividuals Involved:\n\n--------------------------------------------------------\nItems Confiscated:\n\n--------------------------------------------------------\nEvidence:\n\n--------------------------------------------------------\nNarrative:\n\n--------------------------------------------------------\nAdditional Notes:\n\n--------------------------------------------------------', '{"(M) Joyriding":1,"(M) Assault on Emergency Personnel":5,"(F) Second Degree Robbery":1,"(F) Kidnapping":1,"(M) Receiving / Possesion of Stolen Property":1,"(F) Attempted Murder on Emergency Personnel":1,"(M) Battery on Emergency Personnel":1,"(F) Possesion of Stolen Goods":1,"(F) Sexual Harrassment":1}', 'Taylor Williams', 'John Doe', '02-20-2021 22:42:31', 180),
	(112, 343, 'C.King arrest 004', '                      !Plead Guilty!\n------------------------------------------------------------\nOfficers Involved:\n236 T.Noire\n636 J.Sider\n205 T.Katana\n302 E.Foo\n301 T.Williams\n------------------------------------------------------------\nEvidence:\nhttps://gyazo.com/86b9ab62ea9200ec8ed5386b2a8cef5c\nhttps://gyazo.com/ce0388e9a48297c5b0e13e5cd05827b9\n------------------------------------------------------------\nIncident: I spotted a suspect taking another individual hostage at the taco shop they shortly after drove to the flecca at legion where they began to rob it after it turned into a 10-80 when they drove to the baseball field where they started punching officers eventually all suspects were downed and taken to pillbox for medical.\n\n------------------------------------------------------------\nAdditional notes:\nFined $3000', '{"(M) Criminal Possesion of a Firearm [Class 1]":1,"(F) Second Degree Robbery":1}', 'Tank Noire', 'Colton King', '02-20-2021 22:45:20', 20),
	(113, 67, 'T. Skonberg #005', 'Officers Involved: 205 | Katana, 236 | Tank, 331 | Scooter\n\n--------------------------------------------------------\nIndividuals Involved: Marty Woo, Triston Skonberg, John Doe, Colton King\n\n--------------------------------------------------------\nItems Confiscated: N/A\n\n--------------------------------------------------------\nEvidence: Vehicle used in Fleeca Bank robbery, nothing in pockets\n\n--------------------------------------------------------\nIncident: 4 individuals robbed the Fleeca Bank at the corner of Hawick & Elgin with one hostage. Demands were NO AIR ONE and we got to pick the second demand which was AIR ONE. Suspects fled the scene in a grey in color 4 door Sultan. After a very brief chase the suspects pulled into a baseball field and proceeded to exit the vehicle and fist fight 4 of us. After a long battle with tasers and cuffing and uncuffing we apprehended all suspects. They were taken to PILLBOX medical to have all the taser prongs removed and ice on their bruises. All four suspects were transported to MRPD for processing.\n\n--------------------------------------------------------\nAdditional Notes: \n\n--------------------------------------------------------', '{"(M) Battery":1,"(M) Assault on Emergency Personnel":1}', 'Justin Sider', 'Triston Skonberg', '02-20-2021 22:53:22', 10),
	(114, 232, 'J. Fuego Arrest #003', '305 | Sarz\n121 | King\n211 | Jones\n202 | Smith\n222 | Cranium\n352 | McGuinness\n\n------\nI arrived on scene of a bank truck late.  Officers were already exchanging gunfire with suspects involved in a Bank Truck Robbery.  The individuals decided to attempt to flea the area when officer closed in on them and drove their piece of shit car off of a 3 story building and it crashed.  1 individual ran from the vehicle which is who I chased and took into custody.  He came without much of a fuss.\n\n------\nItems Confiscated\nPistol\nOxy x4\n\n------\n*Pleaded Guilty*\n', '{"(M) Robbery":1,"(M) Resisting Arrest":1,"(M) Criminal Possesion of a Firearm [Class 1]":1,"(M) Possession of Drug Paraphernalia":1}', 'Michael Sarz', 'John Fuego', '02-21-2021 18:29:19', 40),
	(115, 170, 'T. TheFuck arrest #002', '                         !Plead Guilty!\n------------------------------------------------------------\nOfficers Involved:\n320 T.Noire\n211 N.Jones\n205 T.Katana\n352 S.McGuinness\n------------------------------------------------------------\nEvidence:\nhttps://gyazo.com/0f953a2897d261a3f0aae33ccbc71864\n\n------------------------------------------------------------\nIncident report: We received a call for a Fleeca bank robbery at the pink cage one and once we arrived there were two suspects inside with a hostage there demands were free passage no spike strips shortly after they proceeded to leave the bank where they eventually crashed at the taxi business where one of the individuals flew out and was caught shortly after we proceeded to chase the white comet until it took the canal bridge jump and missed where the car fell into an explosive tank and blew up both suspects were then taken to pillbox for medical.\n------------------------------------------------------------\nAdditional notes:\nFined $7,000\n', '{"(M) Criminal Possesion of a Firearm [Class 1]":1,"(M) possesion of Burglary Tools":1,"(F) Second Degree Robbery":1,"(F) Possesion of Stolen Goods":1}', 'Tank Noire', 'Tobias TheFuck', '02-21-2021 20:32:43', 50),
	(116, 301, 'Bee Arrest #1', 'Officers Involved: 320 | T. Summers, 205 T. Katana, 352 S. McGuinness, 211 N. Jones\n\n--------------------------------------------------------\nIndividuals Involved: Lrchie Bee\n\n--------------------------------------------------------\nItems Confiscated: 1 Glock, 15 ammo, 1 Knife\n\n--------------------------------------------------------\nEvidence: https://i.imgur.com/LY3tqDM.png\n\n--------------------------------------------------------\nNarrative: Myself, 320, 305, and 211 arrived at a fleeca. The demands were no spikes and free passage with one hostage. Myself and Katana took the hostage. We then re-joined the 10-80, and took secondary. The suspects crashed, and one suspect was ejected. We chased him on foot. once apprehended we asked him if he wanted medical attention, he said no. So we then brought him to MRPD for processing. his ammo, glock, and knfie were taken by Mr. Katana, and he was charged accordingly. \n\n--------------------------------------------------------\nAdditional Notes: Pled Guilty\n\n--------------------------------------------------------\n', '{"(F) Second Degree Robbery":1,"(M) Criminal use of a Firearm":1,"(M) Evading":1}', 'Spencer McGuinness', 'Lrchie Bee', '02-21-2021 20:38:14', 30),
	(117, 70, 'J. Turner Arrest #001', '305 | Sarz\n302 | Foo\n301 | Taylor\n258 | Bobbins\n211 | Jones\n\n----- \nOfficers and Deputies arrived to the Humane Labs for a Bank Truck robbery.  I did my best to take control of the scene as swat lead and everyone listened really well and we stomped out all 4 grapes and made juice with only Foo going down with some minor shots to the vest.  We sweeped up the grape juice all the way to the back including having Jones using scuba to roll through the back and surprised them with a Pinch.\n\n-----\n*Confiscated*\n2 Glock 17s\n9 Oxy\n4 Rolls of Cash \n9 Stacks of Cash\nSecurity Card B\n-----\n\n*pleaded guilty*', '{"(F) First Degree Robbery":1,"(M) Possession of Drug Paraphernalia":1,"(F) Attempted Murder on Emergency Personnel":1,"(M) Criminal Possesion of a Firearm [Class 1]":2}', 'Michael Sarz', 'Jase Turner', '02-21-2021 20:52:55', 75),
	(118, 87, 'D.Kowalchuk Arrest #003', 'Title format  Adam Brian | Arrest #XXX\n------------------------------------------------------------\n\nOfficers Involved: \n301 | Taylor Williams\n302 | Edgar Foo \n305 | Michael Sarz\n358 | Tim Bobbins\n211 | Nate Jones\n------------------------------------------------------------\n\nItem\'s Taken: \nNothing\n\n------------------------------------------------------------\n\nSituation Report: Units responded to a 10-90 bank truck inside the humane labs. 305 went and grabbed the swat truck and we made assault on the front doors. 211 went with a diving suit around the back and came for the flank. The shootout lasted a while with the 4 units down 2 on the assault and were having a hallway stand-off. Once 211 had come from the back it was game over with the units taking out the remaining 2 suspects. Dustin did not have a fire-arm on him and tested GSR negative. Another suspect had 2 fire arms and its possible his fire arm was removed. \n\n------------------------------------------------------------\n\n-Additional info-\n\nAccomplices:\n\n\nVehicles Used: \nBank Truck\n9f \nSultan RS\n------------------------------------------------------------\n\nPleaded: Guilty\n', '{"(F) First Degree Robbery":1}', 'Taylor Williams', 'Dustin Kowalchuk', '02-21-2021 21:02:14', 20),
	(119, 232, 'John Fuego | Arrest | #004', 'Officers Involved:\n358 Tim Bobbins\n301 Taylor Williams\n302 Edgar Foo\n352 Mcguiness\n305 Michael Sarz\n--------------------------------------------------------\nIndividuals Involved:\nJohn Fuego\nJase Turner\nChristopher Johnson\n--------------------------------------------------------\nItems Confiscated:\n1x Glock\n--------------------------------------------------------\nEvidence:\n\n--------------------------------------------------------\nNarrative:\nOfficers responded to a bank truck call at the humane labs. We then breached the humane labs and were able to succesfully take down the suspects. After that we cleared the rest of the humane labs site, and took the suspects down to pillbox and then to Mrpd for processing.\n--------------------------------------------------------\nAdditional Notes:\n\n--------------------------------------------------------', '{"(F) Attempted Murder on Emergency Personnel":1,"(F) Second Degree Robbery":1,"(M) Criminal Possesion of a Firearm [Class 1]":1}', 'Tim Bobbins', 'John Fuego', '02-21-2021 21:16:15', 40),
	(120, 67, 'Triston Skonberg | Arrest | #006', 'Officers Involved:\n\n358 Tim Bobbins\n--------------------------------------------------------\n\nIndividuals Involved:\n\nTriston Skonberg\n\nMarty Woo\n--------------------------------------------------------\nItems Confiscated:\n\n1x Id DJ Woods\n--------------------------------------------------------\nEvidence:\n\n\n--------------------------------------------------------\nNarrative:\n\nOfficer 358 was patrolling in the south side when a brown in color 2 door buggy pulled up and starting ramming officer 358\'s vehicle. This is when the suspect Triston Skonberg got out of the car and then tried to attack me. This is when he started swinging at officer 358. This is when officer 358 pulled out his baton and started swing as he was getting beaten and was scared for his life. This is when he backed up from the area, all of a sudden the passenger in the buggy started opening fire on officer 358, and this was when officer 358 called for backup. Officer 358 in the next 30 seconds disable both individuals. This is when they were taken to pillbox and then mrpd afterward for sentencing.\n--------------------------------------------------------\nAdditional Notes:\n\nSuspect Plead Guilty\n--------------------------------------------------------', '{"(M) Assault on Emergency Personnel":1,"(M) Possesion of Stolen Identification":1}', 'Tim Bobbins', 'Triston Skonberg', '02-21-2021 22:53:15', 22),
	(121, 120, 'Tony Wyoming |ARREST| 001#', 'To be filled in from arresting officer.', '{"(M) Resisting Arrest":1,"(F) Accessory to Second Degree Robbery":1,"(M) Evading":1}', 'Droxx Mercer', 'Tony Wyoming', '02-21-2021 23:15:26', 20),
	(122, 144, 'J. Sanchez Traffic #001', '*Officers Invovled*\n305 | Sarz\nMcGuinness\n\n-----\nTraffic Citation - \nRan a Red and speeding in mirror park.', '{"(I) Third Degree Speeding":1,"(I) Failure to Obey Traffic Control Devices":1}', 'Michael Sarz', 'Juan Sanchez', '02-22-2021 14:29:52', NULL),
	(123, 65, 'M. Woo Arrest #008', '*Officers Involved*\n305 | Sarz\n210 | Papani\n331 | McGuinness\n\n-------\nMyself and 331 have been attempted to be kidnapped about 2 times today and finally we got a good look at them.  We found 2 of the individuals later wearing the same outfit and tried to do a traffic stop on them to investigate but they fled.  Eventually started firing at as out of a Tan Beetle.  The fight went on for about 5 minutes but we eventually put all 3 of the suspects down.  Marty Woo | Triston Skonberg | John Doe.\n\nMASSIVE GUILTY PLEA\n-------\n*Items Confiscated*\nPD Pistol\nOxy\nBody Armor\n\n-------\n*Plead Guilty', '{"(F) Criminal Possession of a Government-Issued Firearm":1,"(F) Battery with a Deadly Weapon":1,"(M) Possession of Drug Paraphernalia":1,"(F) Reckless Evading":1}', 'Michael Sarz', 'Marty Woo', '02-22-2021 15:39:41', 45),
	(124, 67, 'T. Skonberg Arrest #007', '*** PLEAD GUILTY ***\n\nOfficers Involved:\n\n210 | Lieutenant H. Papani\n305 | Captain M. Sarz\n331 | Senior Deputy S. McGuiness\n\n------------------------------------------\n\nIndividuals Involved:\n\nMarty Woo\nJohn Doe\nTriston Skonberg\n\n------------------------------------------\n\nItems Confiscated:\n\n- 1x Pistol Mk2\n- 8x Oxy 10MG\n- 1x Chest Armor\n\n------------------------------------------\n\nIncident Report:\n\n\nMyself and Sarz began an active 80 with a buffalo, this 80 then turned into a shots fired call. Resulting in myself and Sarz Returning fire. Papani showed up, and went down. Myself and Sarz downed the suspects, searched them, took their illegal weapons/Items. We then brought 210 to pillbox and the 95s. They were treated, read their rights, then brought to MRPD for Processing/Booking. ', '{"(F) Battery with a Deadly Weapon":1,"(F) Criminal Possession of a Government-Issued Firearm":1,"(M) Possession of Drug Paraphernalia":1,"(F) Reckless Evading":1}', 'Hunter Papani', 'Triston Skonberg', '02-22-2021 15:40:11', 40),
	(125, 66, 'John Doe Arrest #10', 'Officers Involved: 305 M. Sarz, 331 S. McGuinness, 210 H. Papani\n\n--------------------------------------------------------\nIndividuals Involved: John Doe, Marty Woo, Triston Skonberg\n\n--------------------------------------------------------\nItems Confiscated: x9 IFAKs, x1 PD Pistol, x1 Flashlight\n\n--------------------------------------------------------\nEvidence: https://gyazo.com/13639fc9d39f0470e09d77e2eed6f475\n\n--------------------------------------------------------\nNarrative: Myself and Sarz began an active 80 with a buffalo, this 80 then turned into a shots fired call. Resulting in myself and Sarz Returning fire. Papani showed up, and went down. Myself and Sarz downed the suspects, searched them, took their illegal weapons/Items. We then brought 210 to pillbox and the 95s. They were treated, read their rights, then brought to MRPD for Processing/Booking. \n\n--------------------------------------------------------\nAdditional Notes: Blanket Charges, Plead Guilty. \n\n--------------------------------------------------------\n', '{"(F) Criminal Possession of a Government-Issued Firearm":1,"(F) Battery with a Deadly Weapon":1,"(M) Possession of Drug Paraphernalia":1,"(F) Reckless Evading":1}', 'Spencer McGuinness', 'John Doe', '02-22-2021 15:56:05', NULL),
	(126, 65, 'M. Woo Arrest #009', 'Officers Involved:\n211 N. Jones \n210 H. Papani \n120 D. Dilmore\n110 M. King \n--------------------------------------------------------\nIndividuals Involved:\nMarty Woo\nJohn Doe\n--------------------------------------------------------\nItems Confiscated:\nx2 KnightSticks\nx1 tazer\nx1 IFAK\n--------------------------------------------------------\nNarrative:\nOfficer 110 M.King was taken Hostage from the Kortz Center and went on an hour long 10-80. Air one lost eyes and they found where they were last at. Once the officers regained eyes, the officers went into another 10-80 which lasted 20-30 minutes. 110 Was taken to pillbox and treated while john doe was taken to pillbox and treated. Marty and John were both taken to MROD for booking.\n--------------------------------------------------------\nAdditional Notes:\nPled Guilty \n--------------------------------------------------------', '{"(F) Kidnapping":2,"(M) Battery on Emergency Personnel":2,"(F) Criminal Possession of a Government-Issued Firearm":1}', 'Hunter Papani', 'Marty Woo', '02-22-2021 17:41:37', 175),
	(127, 66, 'John Doe Arrest #11', 'Officers Involved:\n211 N. Jones \n210 H. Papani \n120 D. Dilmore\n110 M. King \n--------------------------------------------------------\nIndividuals Involved:\nMarty Woo\nJohn Doe\n--------------------------------------------------------\nItems Confiscated:\nx2 KnightSticks\nx1 tazer\nx1 IFAK\n--------------------------------------------------------\nNarrative:\nOfficer 110 M.King was taken Hostage from the Kortz Center and went on an hour long 10-80. Air one lost eyes and they found where they were last at. Once the officers regained eyes, the officers went into another 10-80 which lasted 20-30 minutes. 110 Was taken to pillbox and treated while john doe was taken to pillbox and treated. Marty and John were both taken to MROD for booking.\n--------------------------------------------------------\nAdditional Notes:\nPled Guilty - Full Time\n--------------------------------------------------------', '{"(F) Kidnapping":2,"(M) Battery on Emergency Personnel":2,"Criminal Possession of Government Property (x1)":4}', 'Nate Jones', 'John Doe', '02-22-2021 18:19:26', 270),
	(128, 137, 'Tyler Trumbone Arrest #3', 'Officers Involved: 222 Cranium, 211 N. Jones, 331 S. McGuinness, 322 S. Rush\n\n--------------------------------------------------------\nIndividuals Involved: Tyler Trumbone\n\n--------------------------------------------------------\nItems Confiscated: x69 gold bars\n\n--------------------------------------------------------\nEvidence: https://gyazo.com/002ec63f132ca566c2f2b9eea32c097e \nhttps://gyazo.com/edb3f0f967b8a8685ab9d790992b9ce7\n--------------------------------------------------------\nNarrative: 211 And myself arrived at the Fleeca. Demands were the LS Special. 1 Hostage. We then began an 80 and the suspect yeeted himself off the pier. I chased him in the water for around 10 minutes, and finally apprehended him with 211. Scooter also helped driving the boat. We then brought the 95 to MRPD, for processing and booking. \n\n--------------------------------------------------------\nAdditional Notes: Pled Guilty \n\n--------------------------------------------------------', '{"(F) Possesion of Stolen Goods":1,"(F) First Degree Robbery":1,"(M) Evading":1}', 'Spencer McGuinness', 'Tyler Trumbone', '02-22-2021 22:52:14', NULL),
	(129, 377, 'S.Mage Ticket #001 ', 'I was heading northbound on Davis avenue when a 2 door silver sport\'s car crossed the double yellow line to pass me on the opposite lanes of travel. He was then pulled over issued a ticket for the violation. ', '{"(I) Failure to Obey Traffic Control Devices":1}', 'Robert Stone', 'Scotty Mage', '02-23-2021 09:42:32', NULL),
	(130, 353, 'Wyles Hayze | 001#', 'Officers Involved:\n361 | F.Reeves\n551 | D.Mercer\n--------------------------------------------------------\nIndividuals Involved:\nWyles Hayze\n--------------------------------------------------------\nItems Confiscated:\nN/A\n--------------------------------------------------------\nEvidence:\nN/A\n--------------------------------------------------------\nNarrative:\nSuspect was seen speeding in excess of 100 mph in the downtown area. Myself and Reeves performed a 10-38 where he admitted to Grand theft auto once the plates was read. suspect was taken to mrpd and processed\n--------------------------------------------------------\nAdditional Notes:\nSuspect claimed to have stolen the vehicle from his father.\nWas very co operative', '{"(F) Grand Theft Auto":1}', 'Droxx Mercer', 'Wyles Hayze', '02-24-2021 13:35:14', 5),
	(131, 170, 'Tobias TheFuck Arrest #003', 'Officers Involved:\n322 | S. Rush\n232 | R. Stone\n331 | S. McGuinness\n110 | M. King\n211 | N. Jones\n320 | T. Noire\n--------------------------------------------------------\nIndividuals Involved:\nBeshoy Hannah\nUrchie Bee\nKrystal Lights\n--------------------------------------------------------\nItems Confiscated:\n1x Glock 47\n6x Oxy\n2x lockpicks\n--------------------------------------------------------\nEvidence:\nhttps://i.imgur.com/TVQEQoa.png (Tobias\'s pockets)\n\n--------------------------------------------------------\nNarrative:\nWe received a call for a bank truck at legion square once we arrived we saw two bank trucks parked underneath legion at the garage shortly after the individuals inside started firing shortly after all officers breached and we were able to down every suspect they were then taken to pillbox for medical.\n\n\n--------------------------------------------------------\n**PLEAD GUILTY**\n\n--------------------------------------------------------\n', '{"(M) Criminal Possesion of a Firearm [Class 1]":1,"(M) Assault on Emergency Personnel":6,"(F) First Degree Robbery":2,"(M) Possesion of a Controlled Dangerous Substance":1}', 'Scooter Rush', 'Tobias TheFuck', '02-24-2021 18:16:16', 75),
	(132, 110, 'K.Lights arrest #002', '                      !Plead Guilty!\n------------------------------------------------------------\nOfficers Involved:\n320 T.Noire\n110 M.King\n211 N.Jones\n331 S.McGuinness\n322 S.Rush\n232 R.Stone\n\n------------------------------------------------------------\nEvidence:\nhttps://gyazo.com/abe55e924a3eb873872b89ec707254f2\n\n------------------------------------------------------------\nIncident Report: We received a call for a bank truck at legion square once we arrived we saw two bank trucks parked underneath legion at the garage shortly after the individuals inside started firing shortly after all officers breached and we were able to down every suspect they were then taken to pillbox for medical.\n\n------------------------------------------------------------\nAll suspects Involved: \nB.Hanna\nT.TheFuck\nL.Bee\n\n', '{"(M) Criminal use of a Firearm":1,"(M) Assault on Emergency Personnel":6,"(F) First Degree Robbery":2,"(M) Criminal Possesion of a Firearm [Class 1]":1}', 'Tank Noire', 'Krystal Lights', '02-24-2021 18:19:22', 75),
	(133, 109, 'B.Hanna - Arrest #002', 'Officers Involved:\n\n110 M.King\n211 N.Jones\n232 R.Stone\n320 T.Noire\n322 S.Rush\n331 S.McGuinness\n\n--------------------------------------------------------\nIndividuals Involved:\n\nB. Hanna\nK. Lights\nT. Thefuck\nL. Bee\n\n\n\n--------------------------------------------------------\nItems Confiscated:\n\n1x Pistol\n1x Knife\n\n--------------------------------------------------------\nEvidence:\n\nAll Officers Involved with Shootout\n\n\n--------------------------------------------------------\nNarrative:\n\nResponded to a 10-80 of a Gruppe6 truck, upon arriving at the location of the robbery we found out that there was 2x Gruppe6 Trucks in the lower part of Legion Squares car park.\n\n\nUpon entering the car park, we was shot at immediately, We downed all suspects and got them into custody. We treated the best we could for their injuries before transporting them to Pillbox to receive medical treatment.\n\nOnce Medical treatment was received we transported them to MRPD for processing and charges. They all pleaded guilty to their charges.\n--------------------------------------------------------\nAdditional Notes:\n\nSentenced for 75 Months from 117\n\n--------------------------------------------------------', '{"(M) Criminal Possesion of a Firearm [Class 1]":1,"(M) Criminal use of a Firearm":1,"(F) First Degree Robbery":2,"(M) Assault on Emergency Personnel":6}', 'Mike King', 'Beshoy Hanna', '02-24-2021 18:21:27', 75),
	(134, 72, 'A.Morgan | Arrest #001', 'Officer(s) Involved: 232 R.Stone \n\n----------------------\nNarrative: Mr Morgan come into MRPD requesting a weapon\'s license, He was then searched to which i found 1x glock on his persons as well as x2 oxy. He was charged and sentenced. He plead guilty to all of these charges.\n\n----------------------\nEvidence:\n\n----------------------\nSuspect Pleaded Guilty ', '{"(M) Criminal Possesion of a Firearm [Class 1]":1,"(M) Possesion of a Controlled Dangerous Substance":1}', 'Robert Stone', 'Arthur Morgan', '02-24-2021 18:24:47', 10),
	(135, 301, 'Bee Arrest #2', 'Officers Involved: 211 N. Jones, 331 S. McGuinness, 232 R. Stone, 320 T. Noire, 110 M. King\n\n--------------------------------------------------------\nIndividuals Involved: Lrchie Bee, Tobias TheFuck, Bushoy Hanna, K. Lights\n\n--------------------------------------------------------\nItems Confiscated:  x3 ammo, x1 Glock, x2 Joints, x1 Lockpick, x8 OXY, and x1 PISTOL SUPRESSOR. \n\n\n--------------------------------------------------------\nEvidence: P.S. Evidence Lockup\n\n--------------------------------------------------------\nNarrative: Responded to a 10-80 of a Gruppe6 truck, upon arriving at the location of the robbery we found out that there was 2x Gruppe6 Trucks in the lower part of Legion Squares car park.Upon entering the car park, we was shot at immediately, We downed all suspects and got them into custody. We treated the best we could for their injuries before transporting them to Pillbox to receive medical treatment.Once Medical treatment was received we transported them to MRPD for processing and charges. They all pleaded guilty to their charges.\n\n\n--------------------------------------------------------\nAdditional Notes: Pled Guilty | Blanket Charges\n\n--------------------------------------------------------\n', '{"(F) First Degree Robbery":2,"(M) Criminal Possesion of a Firearm [Class 1]":1,"(M) Assault on Emergency Personnel":6,"(M) Criminal use of a Firearm":1,"(M) Possesion of a Controlled Dangerous Substance":1}', 'Spencer McGuinness', 'Lrchie Bee', '02-24-2021 18:35:10', 75),
	(136, 158, 'N. Tarantino Arrest #002', 'Officers Involved:\n322 | S.Rush\n302 | E. Foo\n201 | J. Gambino\n120 | D. Gilmore\n231 | B. Harper\n222 | R. Cranium\n--------------------------------------------------------\nIndividuals Involved:\nVito Tarantino\n\n--------------------------------------------------------\nItems Confiscated:\n1x Glock 47\n73x Gold Bars\n1x Electronic Kit \n1x Trojan USB\n--------------------------------------------------------\nEvidence:\nhttps://i.imgur.com/kUBtJts.png [1x Electronic Kit, 1x Trojan USB]\nhttps://i.imgur.com/OYvnVD1.png [1x Glock 47, 73x Gold Bars]\n--------------------------------------------------------\nNarrative:\n\nResponded to a Fleeca bank alarm and showed up to find Vito Tarantino with a knife to a hostage and demanded no spike strips and a ride along with 201. After clearing the hostage we then went on a 10-80 throughout the city where Mr. Tarantino 10-50 and surrendered. 231 then cuffed him, read him his rights and searched him and removed the knife. 201 and 231 then took him to MRPD where he plead guilty to all charges and was taken by locals to serve his time in prison. \n\nNola Tarantino was in the back when police arrived on scene got into a chase in the rain 322 & 222 arrived when air 1 spotted him shoot a local out fo a car we puts his arms up we arrest him after deploying tazes cause he kept running and getting in the car he shot the local out of we take his gun and gold Elec. kit Trojan USB \n\n--------------------------------------------------------\nAdditional Notes:\n**Plead Guilty**\n--------------------------------------------------------', '{"(F) Kidnapping":1,"(M) Criminal Possesion of a Firearm [Class 1]":1,"(F) Second Degree Robbery":1}', 'Scooter Rush', 'Nola Tarantino', '02-24-2021 21:08:08', 20),
	(137, 92, 'Arrest #1', 'Officers Involved:\n201-J.Gambino\n231 B.Harper\n222 R.Cranium\n322 S.Rush\n302 E.Foo\n\n--------------------------------------------------------\nIndividuals Involved: Vito Tarantino and Nola \n\n--------------------------------------------------------\nItems Confiscated:\nKnife and $432.00\n--------------------------------------------------------\nEvidence:Knife\n\n--------------------------------------------------------\nNarrative:Responded to a Fleeca bank alarm and showed up to find Mr. Tarantino with a knife to a hostage and demanded no spike strips and a ride along with 201. After clearing the hostage we then went on a 10-80 throughout the city where Mr. Taratino 10-50 and surrendered. 231 then cuffed him, read him his rights and searched him and removed the knife. 201 and 231 then took him to MRPD where he plead guilty to all charges and was taken by locals to serve his time in prison. \n\n--------------------------------------------------------\nAdditional Notes: Plead guilty \n\n--------------------------------------------------------', '{"(F) Kidnapping":1,"(F) Second Degree Robbery":1,"(F) Reckless Evading":1}', 'Beyla Harper', 'Vito Tarantino', '02-24-2021 21:10:33', 40),
	(138, 132, 'x1 First degree speeding', 'Officer involved - 361 \n\nIndividual involved - Bobby Demon\n\nCaught speeding through red lights , was on the way to halloween party , was running late so given just a fine', '{"(I) First Degree Speeding":1}', 'Frank Reeves', 'Bobby Demon', '02-25-2021 13:31:05', NULL),
	(139, 391, 'Ronny Hanson Arrest #1', 'Officers Involved:\n211 N.Jones\n110 M. King\n320 T. Tank \n322 S. Rush \n--------------------------------------------------------\nIndividuals Involved:\nRonny Hanson\n--------------------------------------------------------\nItems Confiscated:\nx1 Knife\n--------------------------------------------------------\nEvidence:\nCamera 6\n--------------------------------------------------------\nNarrative:\n211 and 322 responded to a store robbery 322 looked at the camera 6 and saw Ronny Hanson in the back trying to hot the safe. The two officers responded and started a 10-80. The 80 lasted about 30-40 minutes, Ronny Hanson then tried to stab 322 S. Rush he was then gunned down and taken to pillbox for medical exams. Once he was admitted to pillbox and released Ronny Hanson was taken to MRPD for booking.\n--------------------------------------------------------\nAdditional Notes:\nPled Guilty\n--------------------------------------------------------', '{"(M) Third Degree Robbery":1,"(F) Reckless Evading":1,"(M) Assault on Emergency Personnel":1}', 'Nate Jones', 'Ronny Hansen', '02-25-2021 15:52:00', 22),
	(140, 391, 'R. Hanson Arrest #002', 'Officers Involved:\n110 M. King\n320 T. Tank \n322 S. Rush \n_____________________________________________________________________________________________________\nIndividuals Involved:\nRonny Hanson\n_____________________________________________________________________________________________________\nItems Confiscated:\nx1 Knife\n_____________________________________________________________________________________________________\nEdvidence: \nhttps://i.imgur.com/YIuoAY8.png(Knife)\n_____________________________________________________________________________________________________\nNarrative:\n320 and 322 also 110 responded to a store robbery above big bank 320 suggested going to the store on Prosperity St. Hanson goes in the car that is parked on the street and runs he crashes and starts running pulls out a knife and tries stabbing 110. 110 taze\'s Hanson cuff him he starts to run we finally get him in the car.\n_____________________________________________________________________________________________________\nAdditional Notes:\n**PLED GUILTY**\n_____________________________________________________________________________________________________', '{"(F) Reckless Evading":1}', 'Scooter Rush', 'Ronny Hansen', '02-25-2021 16:53:05', 15),
	(141, 198, 'WARRANT Tony Banks ', 'Officers Involved:\n211 N.Jones\n101 A.Noire\n233 S.Mcguinness\n329 T. Noire\n--------------------------------------------------------\nIndividuals Involved:\nTony Banks \n--------------------------------------------------------\nEvidence:\nTony Banks took 5 people hostage and had C4 strapped to each person. Tony Banks also had the rooms rigged to blow inside the university. He then let 2 people out which they went to pillbox. 101 then give his 1 demand a 4 door car. Tony Banks then takes the 3 hostages to buger-shot and he then demanded 50,000 and a PD mustang. \n--------------------------------------------------------\nWanted alive of dead - Full time if caught.', '{"(F) Kidnapping":5,"(F) Terrorism":1,"(F) Criminal Possession of a Firearm [Class 3]":1}', 'Nate Jones', 'Tony Banks', '02-25-2021 20:33:02', 265),
	(142, 65, 'M. Woo', 'Officers Involved:\n211 |N. Jones \n320 |T. Noire\n322 |S.Rush \n--------------------------------------------------------\nIndividuals Involved:\n\nMarty Woo\n--------------------------------------------------------\nItems Confiscated:\nN/A\n-------------------------------------------------------\nEvidence:\nN/A\n--------------------------------------------------------\nNarrative:\nMarty Woo stole a SWAT Suburban Tank pulled out the SWAT Truck and plowed it into a wall\n--------------------------------------------------------\nAdditional Notes:\n**PLEAD GUILTY**\n--------------------------------------------------------\n', '{"(F) Grand Theft Auto":1}', 'Scooter Rush', 'Marty Woo', '02-25-2021 21:47:46', 10),
