	(144, 263, 'Crazy T arrest 002', 'Officers Involved:\n\n359 - Paul Blart\n354 - Dick Chainey\n101 - Ajax Noire\n\n--------------------------------------------------------\nIndividuals Involved:\nCrazy T\n--------------------------------------------------------\nItems Confiscated:\nGlock x 1\n--------------------------------------------------------\nEvidence:\nGlock x 1\n--------------------------------------------------------\nNarrative:\nCrazy T fled from us after attempting a 38. He was a in a green, two door sports car. He 10-50ed and fled on foot where he was captured. \n--------------------------------------------------------\nAdditional Notes:\n\n-------------------------------------------------------', '{"(F) Reckless Evading":1,"(M) Criminal Possesion of a Firearm [Class 1]":1}', 'Paul Blart', 'Crazy T', '02-26-2021 10:43:01', 30),
