	(146, 117, 'JJ Rush ', 'Officers Involved:\n322 | S. Rush \n211 | N. Jones\n\n--------------------------------------------------------\nItems Confiscated:\n1x PD Tazor\n1x PD Pistol\n1x SwitchBlade\n--------------------------------------------------------\nEvidence:\nhttps://i.imgur.com/xaErkC6.png [1x PD Tazor, 1x PD Pistol, 1x SwitchBlade]\n--------------------------------------------------------\nNarrative:\n211 and 322 was responding a two two 10-13s where 322 spots his brother JJ Rush holding a pistol to \n--------------------------------------------------------\nAdditional Notes:\n\n--------------------------------------------------------', '{"(F) Attempted Murder on Emergency Personnel":2,"(F) Grand Theft Auto":1,"(F) Criminal Possession of a Government-Issued Firearm":1}', 'Scooter Rush', 'JJ Rush', '02-26-2021 22:02:30', 200),
	(147, 109, 'B.Hanna - arrest 004', 'Officers Involved:\n110, 639, 641\n--------------------------------------------------------\nIndividuals Involved:\nBeshoy hanna\n--------------------------------------------------------\nItems Confiscated:\nGlock 47 w/ silencer\n--------------------------------------------------------\nEvidence:\n\n--------------------------------------------------------\nNarrative:\nMr. Hanna pulled up next to us and engaged in small talk, after noticing his vehicle was not road worthy we pulled him over. He failed to inform us of his real name then proceeded  to run from us going on a highway, then jumped off and broke his legs. Took him to pillbox to get care. After he got cared by mike units we took him down to MRPD to book him.\n--------------------------------------------------------\nAdditional Notes:\ntime served - Released from MRPD\n--------------------------------------------------------', '{"(F) Criminal Possession of a Weapon Attachment":1,"(F) Grand Theft Auto":1,"(F) Driving Under the Influence":1,"(M) Failure to Inform":1,"(M) Criminal Possesion of a Firearm [Class 1]":1}', 'Miguel Ruiz', 'Beshoy Hanna', '02-27-2021 16:47:13', 66),
