	(152, 141, 'Warrant for Arrest', 'Officers Involved:\n640 C.Appel-Bottom\n635 D.Shukar\n638 J.Vido\n322 S.Rush\n551 D.Danger\n\n--------------------------------------------------------\nIndividuals Involved: \nChristopher Johnson\n\n\n\n--------------------------------------------------------\nItems Confiscated:\n\n--------------------------------------------------------\nEvidence:\n\n--------------------------------------------------------\nNarrative:\nOriginated in a traffic across the street from taco shop, during traffic stop 2 other vehicles came up to the traffic stop threatening to open fire on officers if they did not leave. officers informed the individuals to not threaten an officer which proceeded to them opening fire on LEO\'s X5\n--------------------------------------------------------\nAdditional Notes:\n\n--------------------------------------------------------', '{"(M) Criminal Threats":1,"(F) Attempted Murder":3,"(I) First Degree Speeding":1}', 'Cornellius AppelBottom', 'Christopher Johnson', '02-28-2021 21:24:57', 95),
	(153, 304, 'J. Kov Warrant 2/28/2021', '*Officers Involved*\n305 | Sarz\n635 | Shakur\n\n-------\n\n305 and 635 pulled a HEAT unit for the reason of the constant street racing in the city.  We had been in a few chases with numerous vehicles through the evening and got a 10-38 on a vehicle on Strawberry, upon our arrival to the vehicle multiple more vehicles rolled up on us.  One of the vehicles being a White Corvette C7 Driven by Joe Kov. (Joe Kov has been wearing the same clothes and mask all even and i have spoken to him multiple times through the day.)  And another vehicle was a blue Subaru WRX STI - License plates is SAVAGE which comes back to Aaron Rezzos (Rezzeos was later identified by myself when he came and harassed us more at MRPD and I asked him if he owned the vehicle and talked more about he had just shot us in the face, he then later tried to retract his statement saying it wasn\'t his.  But Rezzos is a known affiliate of Kov and was also wearing the same bandanna. They threatend to shoot us on on our traffic stop and guns were drawn on both sides.  We chose to try to get back into our vehicle and started driving with out emergency lights on.  Rezzos Brake checked me into ramming him, and then gunshots were shot at us from 3 - 4 other vehicles.  Joe Kov was downed by Shakur in this incident but 5 officers were also shot down.  ', '{"(M) Criminal Threats":1,"(F) Attempted Murder on Emergency Personnel":3}', 'Michael Sarz', 'Joe Kov', '02-28-2021 21:57:52', 140),
	(154, 208, 'A. Rezzo Warrant 2/28/2021', '*Officers Involved*\n305 | Sarz\n635 | Shakur\n551 | Danger\n\n-------\n\n*Report Continued from Joe Kov Warrant 2/28/21*\n\n----\n\n305 and 635 pulled a HEAT unit for the reason of the constant street racing in the city.  We had been in a few chases with numerous vehicles through the evening and got a 10-38 on a vehicle on Strawberry, upon our arrival to the vehicle multiple more vehicles rolled up on us.  One of the vehicles being a White Corvette C7 Driven by Joe Kov. (Joe Kov has been wearing the same clothes and mask all even and i have spoken to him multiple times through the day.)  And another vehicle was a blue Subaru WRX STI - License plates is SAVAGE which comes back to Aaron Rezzos (Rezzeos was later identified by myself when he came and harassed us more at MRPD and I asked him if he owned the vehicle and talked more about he had just shot us in the face, he then later tried to retract his statement saying it wasn\'t his.  But Rezzos is a known affiliate of Kov and was also wearing the same bandanna. They threatend to shoot us on on our traffic stop and guns were drawn on both sides.  We chose to try to get back into our vehicle and started driving with out emergency lights on.  Rezzos Brake checked me into ramming him, and then gunshots were shot at us from 3 - 4 other vehicles.  Joe Kov was downed by Shakur in this incident but 5 officers were also shot down.\n\n*Continued*\n\nTo identify Rezzos in this act we came into MRPD Lower Garage - Threated Officers again - and claimed it was his vehicle has he was driving and on got super upset when I kicked it. Later on he tried to deny it was his vehicle noticing that I caught him in a lie.\n\n------', '{"(F) Reckless Evading":1,"(F) Attempted Murder on Emergency Personnel":3,"(M) Criminal Threats":1}', 'Michael Sarz', 'Aaron Rezzo', '02-28-2021 22:12:04', 160),
	(155, 141, 'Possible Stolen Vehicle Stop', 'Date: 2/28/21\n\nTime: 22:50\n\nOfficers Involved:\n551|Duke Danger\n305|Michael Sars\n--------------------------------------------------------\nIndividuals Involved:\nUnknown x4 failure to identify.\n--------------------------------------------------------\nItems Confiscated:\nN/A\n--------------------------------------------------------\nEvidence:\nN/A\n--------------------------------------------------------\nNarrative:\nOfficer Danger (myself) was patrolling Northbound on Power Street toward the Vespucci Boulevard intersection. As I approached the intersection, a dark purple Raiden sped through the red light at roughly 60+ mph. I initiated lights and sirens, the vehicle then proceeded to stop on Alta street before the San Andreas Ave onramp. I identified the vehicle being occupied 4x. As I approached the vehicle, all the inviduals were wearing masks, black clothing and vests. They first failed to identify themselves and said they were borrowing a friends vehicle. The driver claimed he didn\'t have identification on him and the passengers stated he was Joe Kov. The Raiden plate (ZJN HBWA) came back to a Christopher Johnson who I don\'t believe was in the vehicle. After running the plate, Sars arrived on scene and we made further contact. We eventually asked the driver to step out of the vehicle to ask him a few questions. We had to ask 5 or so times as he continuously denied. The vehicle crept farther onto the sidewalk and knocked over a city sign. After continued failure to comply the driver sped in reverse and fleed southbound on Alta. Being the only two units on duty, myself and Sars decided not to pursue. \n--------------------------------------------------------\nAdditional Notes:\nWe have no positive identification on any of the occupants in the vehicle. Haven\'t checked in with the original driver yet to ensure it is stolen. \n--------------------------------------------------------\n', '{"(M) Vandalism of Government Property":1,"(M) Failure to Inform":1,"(I) First Degree Speeding":1}', 'Duke Danger', 'Christopher Johnson', '02-28-2021 23:23:04', NULL),
	(156, 468, 'WARRANT NULL', '*Officers Involved*\n305 | Sarz\n\n-------\n\nJohn Doe Kidnapped an officer using a knife,  we had positive ID on him because he did these acts shortly after we dropped him off at pillbox after stealing a CVPI from LSPD.  He kidnapped Officer Chainy and held a knife to his throat.  He fled from officer in another stolen Crown Vic driven by Marty Woo who was not wearing any sort of facial covering.  Eventually they broke our chase and we found them again in the grave yard near the golf course.  They took Chainey and stabbed him and fled from that scene as well in the CVPI.  Myself and my cadet at the time took care of the 10-13 and went back on patrol.  We shortly found Marty and John driving out of Bennys and John got out of the vehicle and fled on foot.  Marty fled in the vehicle and we decided to trade john after we got him in custody for the stolen vehicle.  We made the trade but Marty called in a ride from someone that didn\'t know they were about to be kidnapped.  That person was Tony Wyoming in his Green jeep that allegedly was kidnapped Via a Police Baton, they fled up mount chiliad and we could not keep up.\n\n--------', '{"(F) Reckless Evading":1,"(M) Evading":1,"(F) Attempted Murder on Emergency Personnel":1,"(F) Grand Theft Auto":1,"(F) Kidnapping":2}', 'Michael Sarz', 'John Doe', '03-01-2021 16:05:57', 130),
	(157, 65, 'M. Woo Warrant 3/1/21', '*Officers Involved*\n305 | Sarz\n202 | Smith\n220 | Noir\n\n--------\n\nJohn Doe Kidnapped an officer using a knife,  we had positive ID on him because he did these acts shortly after we dropped him off at pillbox after stealing a CVPI from LSPD.  He kidnapped Officer Chainy and held a knife to his throat.  He fled from officer in another stolen Crown Vic driven by Marty Woo who was not wearing any sort of facial covering.  Eventually they broke our chase and we found them again in the grave yard near the golf course.  They took Chainey and stabbed him and fled from that scene as well in the CVPI.  Myself and my cadet at the time took care of the 10-13 and went back on patrol.  We shortly found Marty and John driving out of Bennys and John got out of the vehicle and fled on foot.  Marty fled in the vehicle and we decided to trade john after we got him in custody for the stolen vehicle.  We made the trade but Marty called in a ride from someone that didn\'t know they were about to be kidnapped.  That person was Tony Wyoming in his Green jeep that allegedly was kidnapped Via a Police Baton, they fled up mount chiliad and we could not keep up.\n', '{"(F) Reckless Evading":1,"(F) Kidnapping":1,"(F) Accessory to Second Degree Murder on Emergency Personnel":1,"(F) Grand Theft Auto":1}', 'Michael Sarz', 'Marty Woo', '03-01-2021 16:09:01', 95),
	(158, 468, 'Bank Robbery 2021/03/01', 'Officers Involved: Bailey Bubbles 642, Ajax Noire 101\n\nItems Confiscated: 30 Gold bars\n\nFleeca Bank at Legion was being robbed, suspects fled and soon after got pulled over in a traffic stop wearing the same clothing after officers witnessed them selling items over at the pawn shop.\n\nFines: $7500\n\nJail Time: 30 months', '{"(F) Second Degree Robbery":1,"(F) Possesion of Stolen Goods":1,"(F) Kidnapping":1}', 'Bailey Bubbles', 'John Doe', '03-01-2021 16:35:59', 30),
	(159, 67, '3-1-2021', '\nTriston Skonberg\nKnife\n\nArrived at legion bank where they were robbing the bank. They kidnapped 101. Turned into a 10-80. Lost eyes and got eyes again by the VU. \n\n', '{"(F) Kidnapping":1,"(M) Evading":1,"(F) Second Degree Robbery":1}', 'Manuel Ruiz', 'Triston Skonberg', '03-01-2021 16:36:24', 30),
	(160, 120, 'Tony Wyoming Arrest #2', 'Narrative:\n-Mr. Wyoming was involved in a robbery allegedly. He claims he was just in the area as the robbers but matched the description perfectly.\n\nOfficers Involved:\n-110 King\n\nResult:\n-Plead guilty \n-Time served in MRPD', '{"(F) Accessory to Second Degree Robbery":1}', 'Gupta Shakur', 'Tony Wyoming', '03-01-2021 16:41:53', NULL),
	(161, 65, '3-1-21 fleeca robbery', 'Officers Involved:305 sarz, 636 bacon\n\n--------------------------------------------------------\nIndividuals Involved: marty Woo, John Doe\n\n--------------------------------------------------------\nItems Confiscated:1x advanced lockpick\n\n--------------------------------------------------------\nEvidence:\n\n--------------------------------------------------------\nNarrative:During routine patrol, we received an alert for a ongoing robbery in Legion bank. Upon arrival, we learned that there was a hostage taken and demands were required for their safety. once the demands were met, 4 individuals proceeded into pursuit. Upon lost of sight and after a brief patrol of the area, 202 and 636 spotted a vehicle with 4 individuals matching the description from the earlier bank robbery. After watching the individuals break a traffic law, a traffic stop was started. Shortly after identifying multiple individuals, many warrants were served and the suspects were found with illegal possession of robbery items.\n\n--------------------------------------------------------\nAdditional Notes: marty woo was charged with accessory to robbery and possession of burglary tools\n\n--------------------------------------------------------', '{"(F) Accessory to First Degree Robbery":1,"(F) Kidnapping":1,"(M) possesion of Burglary Tools":1,"(M) Conspiracy":1}', 'ChrisP Bacon', 'Marty Woo', '03-01-2021 16:44:09', 35),
	(162, 208, 'A. Rezzo Warrant 2/28/2021', '*Officers Involved*\n305 | Sarz\n635 | Shakur\n551 | Danger\n\n-------\n\n*Report Continued from Joe Kov Warrant 2/28/21*\n\n----\n\n305 and 635 pulled a HEAT unit for the reason of the constant street racing in the city.  We had been in a few chases with numerous vehicles through the evening and got a 10-38 on a vehicle on Strawberry, upon our arrival to the vehicle multiple more vehicles rolled up on us.  One of the vehicles being a White Corvette C7 Driven by Joe Kov. (Joe Kov has been wearing the same clothes and mask all even and i have spoken to him multiple times through the day.)  And another vehicle was a blue Subaru WRX STI - License plates is SAVAGE which comes back to Aaron Rezzos (Rezzeos was later identified by myself when he came and harassed us more at MRPD and I asked him if he owned the vehicle and talked more about he had just shot us in the face, he then later tried to retract his statement saying it wasn\'t his.  But Rezzos is a known affiliate of Kov and was also wearing the same bandanna. They threatend to shoot us on on our traffic stop and guns were drawn on both sides.  We chose to try to get back into our vehicle and started driving with out emergency lights on.  Rezzos Brake checked me into ramming him, and then gunshots were shot at us from 3 - 4 other vehicles.  Joe Kov was downed by Shakur in this incident but 5 officers were also shot down.\n\n*Continued*\n\nTo identify Rezzos in this act we came into MRPD Lower Garage - Threated Officers again - and claimed it was his vehicle has he was driving and on got super upset when I kicked it. Later on he tried to deny it was his vehicle noticing that I caught him in a lie.\n\n------', '{"(F) Reckless Evading":2,"(F) Attempted Murder on Emergency Personnel":3,"(M) Criminal Threats":1}', 'Bailey Bubbles', 'Aaron Rezzo', '03-01-2021 17:56:37', 25),
	(163, 448, '3-1-2021', 'Officers Involved:101, 636\n\n--------------------------------------------------------\nIndividuals Involved:Skippy Drippy\n\n--------------------------------------------------------\nItems Confiscated:1-glock\n\n--------------------------------------------------------\nEvidence:\n\n--------------------------------------------------------\nNarrative:After receiving several shots fired calls, 101, and 636 responded and pursued a white vehicle away from the scene of the crime. Upon pursuit, the white vehicle, with one occupant, opened fire, downing 101. Utilizing my PD weapon, I returned fire and neutralized the threat later identified as Skippy Drippy. After medical attention, Mr. Drippy was charged with Gang related shooting, and attempted murder on LEO.\n\n--------------------------------------------------------\nAdditional Notes:\n\n--------------------------------------------------------', '{"(F) Attempted Murder on Emergency Personnel":1,"(F) Gang Related Shooting":1}', 'ChrisP Bacon', 'Drippy Skippy', '03-01-2021 19:48:01', 95),
	(164, 170, 'Tobias TheFuck 3/1/2021', '101 | A.Noire | 322 Scooter Rush | 636 Chris P. Bacon | \n639 Miguel Ruiz | 333 T.Bobbins | 205 T. Katana | \n\nBeshoy Hanna | Ling Ling | Jacob Parks | Tobias TheFuck\n\nPistol\n\n\n\nBank Truck robbery at humane Labs.', '{"(F) Attempted Murder on Emergency Personnel":1,"(M) Criminal use of a Firearm":1,"(F) Second Degree Robbery":1}', 'Manuel Ruiz', 'Tobias TheFuck', '03-01-2021 20:35:30', 60),
	(165, 361, 'L.Ling | Arrest | #2', 'Officers Involved:\n\n211 Jones\n333 Bobbins\n101 Ajax\n205 Katana\n639 Ruiz\n641 Ruiz\n\n\n--------------------------------------------------------\nIndividuals Involved:\n\nLing Ling\n\n--------------------------------------------------------\nItems Confiscated:\n\n1x broken pistol\n5x Roll of Cash\n4x Stack of Cash\n16x oxy\n\n\n--------------------------------------------------------\nEvidence:\n\n--------------------------------------------------------\nNarrative:\nOfficers responded to a bank truck at humane labs. This is where we shot down the individuals that shot 2 officers down. The last individual which was Ling Ling was trying to escape through the backdoor underwater passage of human labs, but was caught by 333 and 101 in the act and was shot.\n\n\n--------------------------------------------------------\nAdditional Notes:\nPlead Guilty\n--------------------------------------------------------', '{"(M) Criminal use of a Firearm":1,"(F) Attempted Murder on Emergency Personnel":1,"(F) Second Degree Robbery":1,"(F) Criminal Possesion of a Firearm [Class 1]":1}', 'Tim Bobbins', 'Ling Ling', '03-01-2021 20:47:45', 10),
	(166, 418, 'J.Park - Bank Truck Heist 3/1/2021 - #001', 'Officers Involved:\n101 A. NOIRE, 636 C. BACON, 639 M.RUIZ, 322 SCOOTER, 333 T. BOBBINS, 205 T. KATANA\n--------------------------------------------------------\nIndividuals Involved:\nJACOB PARK, TOBIAS DAFUCK, BESHOY HANNA, LING LING\n--------------------------------------------------------\nItems Confiscated:\nGLOCK 47, HANDCUFFS, OXY X8, PISTOL AMMO X3\n--------------------------------------------------------\nEvidence:\nhttps://imgur.com/G5ZRJvN\n--------------------------------------------------------\nNarrative:\n639 GOT A CALL FOR A TRUCK ROBBERY AT HUMAND LABS, ENGAGED INTO A FIRE FIGHT TWO OFFICERS WENT DOWN, THE OFFICERS THEN PUSHED INSIDE TO TAKE DOWN THE SUSPECTS. AFTER SUSPECTS WERE DOWN SCENE WAS CODE 4. TOOK SUSPECTS TO PILLBOX TO GET TREATED, AFTER THE SUSPECTS WERE TREATED WE BROUGHT THEM DOWN TO MRPD FOR BOOKING. MY SUSPECT (JACOB PARK) DID NOT REQUEST A LAWYER. MR PARK HAD A GLOCK 47, HAND CUFFS, 8 OXY, AND 3 PISTOL AMMO. I ASKED IF MR. PARK WANTED A LAWYER, HE REPLIED NO. I FINED MR. PARK $11,500 AND SENTENCED HIM TO 60 MONTHS IN JAIL.\n--------------------------------------------------------\nAdditional Notes:\nGAVE FULL FINES, CUT SENTENCE DOWN TO 60 MONTHS\n--------------------------------------------------------', '{"(F) Attempted Murder on Emergency Personnel":1,"(M) Possesion of a Controlled Dangerous Substance":1,"(M) Criminal use of a Firearm":1,"(F) Second Degree Robbery":1}', 'Miguel Ruiz', 'Jacob Park', '03-01-2021 20:47:48', 60),
	(167, 65, 'Evasion', 'Officers Involved:\n640 C.AppelBottom\n333 T.Bobbins\n551 D.Danger\n--------------------------------------------------------\nNarrative:\nSuspect Attempted to evade in a police cruiser \n--------------------------------------------------------\nAdditional Notes:\n\n--------------------------------------------------------', '{"(F) Reckless Evading":1}', 'Cornellius AppelBottom', 'Marty Woo', '03-02-2021 19:29:15', 5),
	(168, 65, 'Criminal charges', 'Officers Involved:\n640 C.AppelBottom\n333 T.Bobbins\n551 D.Danger\n\n\n--------------------------------------------------------\nIndividuals Involved:\nMarty Woo\n--------------------------------------------------------\nItems Confiscated:\nNone\n\n--------------------------------------------------------\nEvidence:\n\n--------------------------------------------------------\nNarrative: Suspect was taken in custody after found with police cruiser at the casino then during processing, attempted to assault and battery a emergency personnel and attempted murder\n\n--------------------------------------------------------\nAdditional Notes:\n', '{"(F) Escaping Custody":1,"(M) Reckless Endangerment":1,"(I) Riding on a Sidewalk":1,"(M) Battery on Emergency Personnel":1,"Criminal Possession of Government Property (x1)":1,"(F) Extortion":1,"(M) Unlawful Imprisonment":1,"(F) Sexual Harrassment":1,"(M) Assault on Emergency Personnel":1,"(M) Evading":1,"(I) Stalking":1,"(F) Kidnapping":1,"(M) Resisting Arrest":3,"(I) Jaywalking":1,"(F) Attempted Murder on Emergency Personnel":1,"(I) Loitering":1,"(F) Grand Theft Auto":1,"(M) Tampering with a Vehicle":1}', 'Cornellius AppelBottom', 'Marty Woo', '03-02-2021 19:52:04', 20),
	(169, 174, 'Johnson Chaderick Evading', 'Officers Involved:\n551|Duke Danger\n333|Tim Bobbins\n640|Applebottom\n--------------------------------------------------------\nIndividuals Involved:\nJohnson Chaderick\nSuspects from red color "Demon Gang"\n--------------------------------------------------------\nItems Confiscated:\nGlock\n--------------------------------------------------------\nEvidence:\nGlock, pursuit witnesses.\n--------------------------------------------------------\nNarrative:\nFollowing a prior scene at MRPD involving multiple red gang members. We ended a pursuit near Little Seoul, where the red gang suspect in a red GTR met up with a few of his associates. I was riding with Bobbins, and Applebottom arrived on scene. We asked the initial driver of the GTR to step out and other gang members started arguing with us. This continued until Mr. Chaderick was noticed trying to hotwire Applebottom\'s CVPI. He was successful and started to escape northbound up the road. We gave chase for a while and he eventually disabled his vehicle on the beach next to GOH. We tried to escape on foot but was taken into custody shortly after. He claims while we were speaking with the original 10-80 suspect, one of the red gang members pointed a gun at him as well as told him to steal the CVPI. \n--------------------------------------------------------\nAdditional Notes:\nFine:$3000\nTime: 15 months time served while writing report. \n--------------------------------------------------------', '{"(I) First Degree Speeding":1,"(F) Reckless Evading":1,"(M) Resisting Arrest":1}', 'Duke Danger', 'johnson Chaderick', '03-02-2021 20:39:53', 15),
	(170, 170, 'Tobias TheFuck | Arrest | #4', 'Will Do later', '{"(F) Criminal Possesion of a Firearm [Class 1]":1,"(F) Tresspassing on Goverment Property Property":1,"(M) Possesion of a Controlled Dangerous Substance":1,"(F) Reckless Evading":1}', 'Tim Bobbins', 'Tobias TheFuck', '03-02-2021 20:56:15', 5),
	(171, 109, 'Beshoy Hanna Attempted prison break', ' Officers Involved:\n640 C.AppelBottom\n359 P.Blart\n333 T.Bobbins\n351 D.Dazzacone\n301 T.Williams\n--------------------------------------------------------\nIndividuals Involved:\n\n--------------------------------------------------------\nItems Confiscated:\n1x Glock\n--------------------------------------------------------\nEvidence:\n\n--------------------------------------------------------\nNarrative: \nSuspect attempted to sabotage a prison transport leading to arrest\n--------------------------------------------------------\nAdditional Notes:\n\n--------------------------------------------------------', '{"(F) Attempted Murder on Emergency Personnel":1,"(F) Criminal Possesion of a Firearm [Class 1]":1}', 'Cornellius AppelBottom', 'Beshoy Hanna', '03-02-2021 21:02:51', 15),
	(172, 132, 'Bobby Demon | Arrest | #1', 'Officers Involved:\n333 | Tim Bobbins\n359 | Paul Blart\n640 | Appel Bottom\n301 | Taylor Williams\n351 | Dazza Cone\n--------------------------------------------------------\nIndividuals Involved:\n\nBobby Demon\n\n\n--------------------------------------------------------\nItems Confiscated:\n\n1x Glock\n\n--------------------------------------------------------\nEvidence:\n\n--------------------------------------------------------\nNarrative:\n\nWe arrested individual believed to be part of a gang, they all wear red. This is when the individuals asked for a transport. Officers then transported the individuals when they were intercepted by 2 red cars. These individuals all got severely injured and were taken out. They were then taken to pillbox and treated. After that the were sent.\n\n--------------------------------------------------------\nAdditional Notes:\nPlead Guilty\n--------------------------------------------------------', '{"(F) Attempted Murder on Emergency Personnel":1,"(F) Criminal Possesion of a Firearm [Class 1]":1}', 'Tim Bobbins', 'Bobby Demon', '03-02-2021 21:09:46', 10),
	(173, 291, 'Jerry Applestein - Arrest - 001', 'Officers Involved:\n359 - Paul Blart\n333 - Tim Bobbins\n640 - Applebottom\n341 - Dazako\n\n--------------------------------------------------------\nIndividuals Involved:\nJerry Applestein\n--------------------------------------------------------\nItems Confiscated:\nGlock x1\n--------------------------------------------------------\nEvidence:\n \n--------------------------------------------------------\nNarrative:\nRed gang. Tried to break out their pals during a prison transport and got shot down by us.\n--------------------------------------------------------\nAdditional Notes:', '{"(F) Jailbreak":1}', 'Paul Blart', 'Jerry Applestein', '03-02-2021 21:21:00', 20),
	(174, 108, 'Jose Demon - Arrest - 002', 'Officers Involved:\n333 - Tim Bobbins\n359 - Paul Blart\n540 - Applestein\n\n--------------------------------------------------------\nIndividuals Involved:\nJose Demon\n--------------------------------------------------------\nItems Confiscated:\nGlock x1\n--------------------------------------------------------\nEvidence:\n\n--------------------------------------------------------\nNarrative:\nRed gang tried to break their friends out of transport. They were gunned down. Jose was one of these shooters.\n--------------------------------------------------------\nAdditional Notes:', '{"(F) Jailbreak":1}', 'Paul Blart', 'Jose Demon', '03-02-2021 21:24:33', 20),
	(175, 132, 'Bobby Demon 10-90', 'Officers Involved:\n551|Duke Danger\n320|Tank Noire\n322|Scooter Rush\n--------------------------------------------------------\nIndividuals Involved:\nBobby Demon\nWoman in black dress and black mask, evaded.\nMan in full ghillie suit, evaded.\n--------------------------------------------------------\nItems Confiscated:\nGlock, 100mg Oxy\n--------------------------------------------------------\nEvidence:\n\n--------------------------------------------------------\nNarrative:\nWhile filling up on gas 551|Danger, myself, was taken hostage by 3 individuals in two separate coquettes. I was then taken to the Fleeca Bank at Legion Square, where they initiated a 10-90. I was held by a woman in a black dress and gimp mask, as well as Mr. Demon who was wearing a monkey mask and racecar driver outfit. The third individual in the ghillie suit hit the vault. After being cleared I joined into the pursuit with Scooter and Tank. It was quite a long pursuit in which they repaired at Benny\'s, hit me with their car, and got massive air multiple times. We eventually entered the tram tracks behind MRPD and made it all the way to Rockford Hills. They eventually foot bailed at the tram station near Vangelico\'s.  The two other suspects involved made it out and jumped into a red GTR to escape. Bobby Demon tried to run back down the stairs as I gave chase. I tased him on the stairs but he broke out of cuffs. As we got to the tracks I went for another tase but he had pulled a weapon and fired a shot at me. Luckily my taser shot was successful and I took him into custody. I removed  a glock and 100mg of oxy off of him at PD. He pleaded guilty and was given 60 months with $8500 in fines. \n--------------------------------------------------------\nAdditional Notes:\nTwo suspects outstanding. \n--------------------------------------------------------\n', '{"(F) First Degree Robbery":1,"(M) Evading":1,"(F) Criminal Possesion of a Firearm [Class 1]":1,"(F) Kidnapping":1,"(M) Resisting Arrest":1}', 'Duke Danger', 'Bobby Demon', '03-03-2021 18:28:08', NULL),
	(176, 468, 'John Doe - Arrest - 03/03/2021', 'Officer(s) Involved:\n101 - A. Noire\n211 - N. Jones\n322 - S. Rush\n305 - M. Sarz\n551 - D. Danger\n640 - C. AppelBottem\n--------------------\nNarrative:\nOfficers responded to a kidnapping call of 211 & 322 by M. Woo and J. Doe. \n\nOnce officers ran up the ladder they then pushed the officers off and on to the train tracks below, officers the opened fire to which both suspects attempted to jump in the water to where they incapacitated themselves.\n\nOfficers recovered the suspects and the downed officers, to which were then taken to pillbox medical for treatment.\n\nSuspects then were taken to MRPD for processing, to which they then attempted to beat 101 & 551, but were downed, this went one for several mins. Suspects then pleaded guilty.\n------------------\nEvidence:\n--------------------\nNote(s):\nN/A', '{"Criminal Possession of Government Property (x1)":1,"(F) Attempted Murder on Emergency Personnel":1}', 'Ajax Noire', 'John Doe', '03-03-2021 20:37:32', 45),
	(177, 291, 'K. Lights Arrest #003', '*Officer Involved*\n305 | Sarz\n\n-----\n*Pending*\n-----\nItems Confiscated\n103 Gold Bars \nPistol\n\n-----\n\n-----\nPleaded Guilty	', '{"(M) Resisting Arrest":1,"(F) First Degree Robbery":1}', 'Michael Sarz', 'Jerry Applestein', '03-03-2021 21:21:31', 35),
	(178, 291, 'J. Applestein Arrest #001', '*Officers Involved*\n305 | Sarz\n\n----\n\n----\nItems Confiscated\nGlock\nSilencer\n------\n*Pleaded Guilty*\n', '{"(F) Criminal Possession of a Weapon Attachment":1,"(M) Battery on Emergency Personnel":1,"(M) Criminal use of a Firearm":1,"(F) Grand Theft Auto":1}', 'Michael Sarz', 'Jerry Applestein', '03-03-2021 21:24:38', 65),
	(179, 410, 'ULF arrest 3-4-2021', 'Mr. Albukkitelekakamichekeelakafereska was lockpicking a police vehicle while I exited PD garage. I immediately told him stop and exit the police vehicle. During this time, he proceeded to exit MRPD property in police vehicle. After a brief pursuit, Mr. Albukkitelekakamichekeelakafereska was detained.', '{"(M) Disobeying a Lawful Order":1,"(M) Resisting Arrest":1,"(F) Grand Theft Auto":1}', 'ChrisP Bacon', 'Ulf AlbukkiTelekakaMichekelaKafereska', '03-04-2021 17:44:28', 30),
	(180, 164, 'Sean McG Attempted GTA', 'Officers Involved:\n551|Duke Danger \n--------------------------------------------------------\nIndividuals Involved:\nSean McG\n--------------------------------------------------------\nItems Confiscated:\nGlock, will return as individual had a license. \n--------------------------------------------------------\nEvidence:\n\n--------------------------------------------------------\nNarrative:\nWhile responding to a 10-60 on Brouge, I saw the suspects black sentinel speeding down Brouge and cutting behind the 24/7. He then sped into the Mega Mall and parked his vehicle next to a box truck. I witnessed him attempting to break into the truck and then attempted to detain him. After issuing commands he resisted and attempted to get back into his vehicle. I then deployed my taser and took him into custody. He denied both of the charges but was otherwise compliant with me. Sean McG pleaded not guilty and was sent away with $3,000 in fines and 20 months after he told me a funny joke. \n--------------------------------------------------------\nAdditional Notes:\n\n--------------------------------------------------------\n', '{"(M) Resisting Arrest":1,"(F) Grand Theft Auto":1}', 'Duke Danger', 'Sean McG', '03-04-2021 18:14:33', 20),
	(181, 410, 'Ulf arrest #002', '                        !Plead Guilty!\n------------------------------------------------------------\nOfficers Involved: \n320 T.Noire\n322 S.Rush\n\n------------------------------------------------------------\nEvidence:\n\n------------------------------------------------------------\nIncident Report: We received multiple calls for safe robberies and everytime we checked the cameras the same person was inside with the same vehicle eventually we caught him at a store and he proceeded to run from us we lost him shortly after and he made a 911 call saying his car was stolen but it wasn\'t we saw his face at the robbery with his vehicle he then turned himself in at MRPD.\n------------------------------------------------------------\n\n', '{"(M) False Reporting":1,"(M) Third Degree Robbery":2,"(F) Reckless Evading":1}', 'Tank Noire', 'Ulf AlbukkiTelekakaMichekelaKafereska', '03-04-2021 19:00:32', 40),
	(182, 208, 'Aaron Rezzo 2020304', 'Officers Involved: \n253 C.AppelBottom\n\n--------------------------------------------------------\nIndividuals Involved:\n\n--------------------------------------------------------\nItems Confiscated:\n\n--------------------------------------------------------\nEvidence:\n\n--------------------------------------------------------\nNarrative:\nSuspect was caught doing 35 over speed limit\n--------------------------------------------------------\nAdditional Notes:\n\n--------------------------------------------------------', '{"(I) First Degree Speeding":1}', 'Cornellius AppelBottom', 'Aaron Rezzo', '03-04-2021 19:37:56', NULL),
	(183, 484, 'Ethan Barker Arrest #001', 'Officers Involved:\n322 | S. Rush \n320 | T. Noire\n551 | D. Danger\n253 | C. AppelBottom\n________________________________________________________\nIndividuals Involved:\n\nN/A\n________________________________________________________\nItems Confiscated:\n\nN/A\n________________________________________________________\nEvidence:\n\nhttps://i.imgur.com/ftoryMo.jpg (Truck blocking tunnels)\n________________________________________________________\nNarrative: \n\n322 and Half a person Noah Jackson who was riding along with me and we arrived at Fleeca in legion we go on a chase Ethan Barker pulls his truck in front of the tunnel off of Pillbox. to let the guys go into the tunnel to block it from us. He gets out of the truck and runs 322 and 320 chases Ethan Barker taze him 3 - 4 x til we cuff him actually take him to pillbox and than book him in MRPD\n\n________________________________________________________\nAdditional Notes:\n\n**PLEAD GUILTY**\n________________________________________________________', '{"(F) Accessory to Second Degree Robbery":1,"(M) Evading":1,"(M) Aiding and Abetting":1,"(F) Grand Theft Auto":1}', 'Scooter Rush', 'Ethan Barker', '03-04-2021 19:40:27', 45),
	(184, 391, 'R.Hansen - Arrest #003', 'Officers Involved:\n\n110 M.King\n251 D.Jacobs\n221 P.Nut\n\n\n--------------------------------------------------------\nIndividuals Involved:\n\nRonny Hansen\n\n--------------------------------------------------------\nItems Confiscated:\n\n1x Glock\n1x Knife\n\n--------------------------------------------------------\nEvidence:\n\nWitnessed by multiple officers committing crimes\n\n--------------------------------------------------------\nNarrative:\n\nGot a 911 from a one Ulf MTKA saying a Police vehicle had been stolen from MRPD and that the vehicle was harrassing him. Upon entering Legion Square we got approached by Ulf in his Sultan RS saying the Police car was chasing him.\n\nWe then proceeded to get into a 10-80 with the suspect who took us on a ride around Downtown LS. After some time and the suspect massively breaking the speed limit we decided to try and demobolize the vehicle.\n\n202 got on the radio and said if the vehicle was breaking the speed limit by a stupid amount we could go for tyre shots, at which point 221 P.Nutt decided to start shooting tyres.\n\nThe vehicle 10-50\'d into the underpass of Olympic Freeway where the suspect then decided to open fire back at PD, we managed to subdue the suspect and tend to his wounds/GSW\'s.\n\nOnce the suspect was made secure we transported him to Pillbox medical for treatment. Once cleared from Pillbox we transferred him to MRPD for processing.\n\n--------------------------------------------------------\nAdditional Notes:\n\nSuspect pleaded guilty to all charges.\n\n--------------------------------------------------------', '{"(F) Reckless Evading":1,"(M) Criminal use of a Firearm":1,"(M) Assault on Emergency Personnel":1,"(F) Criminal Possesion of a Firearm [Class 1]":1,"(F) Impersonating a Law Enforcement Officer":1,"(F) Grand Theft Auto":1}', 'Mike King', 'Ronny Hansen', '03-05-2021 16:03:37', 40),
	(185, 391, 'R.Hansen arrest #004', '                      !Plead Guilty!\n------------------------------------------------------------\nOfficers Involved: \n320 T.Noire\n322 S.Rush\n251 D.Jacobs\n110 M.King\n101 A.Noire\n------------------------------------------------------------\nEvidence: https://i.imgur.com/Wgwp23d.png\n\n------------------------------------------------------------\nIncident Report: We received a call for a for a Fleeca bank robbery when we arrived there were two individuals inside wearing gillie suits and one hostage shortly after it turned into a 10-80 where the suspects eventually split up one got away in a red sultan rs believed to belong to ulf and the other stole a blue primo eventually he crashed out in sandy where the red sultan tried to pick him up tires were shot and the red sultan left his friend thats when we took him to pillbox for medical and then MPRD for processing.', '{"(F) Kidnapping":1,"(F) Criminal Possesion of a Firearm [Class 1]":1,"(F) Grand Theft Auto":1,"(F) Impersonating a Law Enforcement Officer":1,"(F) Second Degree Robbery":1}', 'Tank Noire', 'Ronny Hansen', '03-05-2021 17:47:47', 70),
	(186, 202, 'Jesse Brooks | Arrest 001', 'Officers Involved:\n251 D. Jackson\n101 A. Noire\n110 M. King\n322 S. Rush\n320 T. Noire\n--------------------------------------------------------\nIndividuals Involved:\nJesse Brooks	\nSean McG\n--------------------------------------------------------\nItems Confiscated:\n7 Copper\n101 Glass\n12 Scrap\n--------------------------------------------------------\nEvidence:\nEvidence Channel\n--------------------------------------------------------\nNarrative:\n101 saw a picture put up on LifeInvader where 2 individuals where standing infront of a car with the caption "Chopping cars and taking names". When 101 saw this he decided a raid on the chop shop should go down, so 551 and other officers went down to the chop shop and proceded to arrest the 2 individuals down there.\n--------------------------------------------------------\nAdditional Notes:\nNot Guilty\n-------------------------------------------------------', '{"(F) Operating a Chop Shop":1}', 'Danny Jacobs', 'Jesse Brooks', '03-05-2021 18:16:25', 20),
	(187, 164, 'S. McG Arrest #001', 'Officers Involved:\n\n251 D. Jackson\n101 A. Noire\n110 M. King\n322 S. Rush\n320 T. Noire\n_______________________________________________________________________________________________________\nIndividuals Involved:\n\n-Jesse Brooks	\n-Sean McG\n_______________________________________________________________________________________________________\nItems Confiscated:\n\n-3x Plastic\n-1x Rubber\n________________________________________________________________________________________________________\nEvidence:\nhttps://i.imgur.com/rmRrvzt.png (Lifeinvader post before taken down)\nhttps://i.imgur.com/vibikOi.png (3x Plastic, 1x Rubber)\n\n_________________________________________________________________________________________________________\nNarrative:\n\n101 saw a picture put up on LifeInvader where 2 individuals where standing infront of a car with the caption "Chopping cars and taking names". When 101 saw this he decided a raid on the chop shop should go down, so 551 and other officers went down to the chop shop and proceded to arrest the 2 individuals down there.\n_________________________________________________________________________________________________________\nAdditional Notes:\n**PLEAD GUILTY**\n__________________________________________________________________________________________________________\n', '{"(F) Operating a Chop Shop":1}', 'Scooter Rush', 'Sean McG', '03-05-2021 18:17:13', 20);
